INSERT INTO `movies` (`id`, `e_id`, `title`, `description`, `poster`, `banner`, `type`, `release_date`, `vote`, `vote_count`, `created_at`, `updated_at`) VALUES
(1, 980489, 'Gran Turismo', 'The ultimate wish-fulfillment tale of a teenage Gran Turismo player whose gaming skills won him a series of Nissan competitions to become an actual professional racecar driver.', '/51tqzRtKMMZEYUpSYkrUE7v9ehm.jpg', '/xFYpUmB01nswPgbzi8EOCT1ZYFu.jpg', 'now_playing', '2023-08-11', 8.00, 806, '2023-10-04 20:52:40', '2023-10-04 20:54:12'),
(2, 678512, 'Sound of Freedom', 'The story of Tim Ballard, a former US government agent, who quits his job in order to devote his life to rescuing children from global sex traffickers.', '/qA5kPYZA7FkVvqcEfJRoOy4kpHg.jpg', '/pA3vdhadJPxF5GA1uo8OPTiNQDT.jpg', NULL, '2023-07-04', 8.00, 598, '2023-10-04 20:52:41', '2023-10-04 20:52:41'),
(3, 565770, 'Blue Beetle', 'Recent college grad Jaime Reyes returns home full of aspirations for his future, only to find that home is not quite as he left it. As he searches to find his purpose in the world, fate intervenes when Jaime unexpectedly finds himself in possession of an ancient relic of alien biotechnology: the Scarab.', '/mXLOHHc1Zeuwsl4xYKjKh2280oL.jpg', '/1syW9SNna38rSl9fnXwc9fP7POW.jpg', NULL, '2023-08-18', 7.10, 1147, '2023-10-04 20:52:42', '2023-10-04 20:52:42'),
(4, 968051, 'The Nun II', 'In 1956 France, a priest is violently murdered, and Sister Irene begins to investigate. She once again comes face-to-face with a powerful evil.', '/5gzzkR7y3hnY8AD1wXjCnVlHba5.jpg', '/mRGmNnh6pBAGGp6fMBMwI8iTBUO.jpg', 'now_playing', '2023-09-08', 6.90, 497, '2023-10-04 20:52:43', '2023-10-04 20:54:12'),
(5, 615656, 'Meg 2: The Trench', 'An exploratory dive into the deepest depths of the ocean of a daring research team spirals into chaos when a malevolent mining operation threatens their mission and forces them into a high-stakes battle for survival.', '/4m1Au3YkjqsxF8iwQy0fPYSxE0h.jpg', '/8pjWz2lt29KyVGoq1mXYu6Br7dE.jpg', NULL, '2023-08-04', 6.90, 2121, '2023-10-04 20:52:43', '2023-10-04 20:52:43'),
(6, 385687, 'Fast X', 'Over many missions and against impossible odds, Dom Toretto and his family have outsmarted, out-nerved and outdriven every foe in their path. Now, they confront the most lethal opponent they\'ve ever faced: A terrifying threat emerging from the shadows of the past who\'s fueled by blood revenge, and who is determined to shatter this family and destroy everything—and everyone—that Dom loves, forever.', '/fiVW06jE7z9YnO4trhaMEdclSiC.jpg', '/4XM8DUTQb3lhLemJC51Jx4a2EuA.jpg', NULL, '2023-05-19', 7.30, 3930, '2023-10-04 20:52:44', '2023-10-04 20:52:44'),
(7, 762430, 'Retribution', 'When a mysterious caller puts a bomb under his car seat, Matt Turner begins a high-speed chase across the city to complete a specific series of tasks. With his kids trapped in the back seat and a bomb that will explode if they get out of the car, a normal commute becomes a twisted game of life or death as Matt follows the stranger\'s increasingly dangerous instructions in a race against time to save his family.', '/oUmmY7QWWn7OhKlcPOnirHJpP1F.jpg', '/iiXliCeykkzmJ0Eg9RYJ7F2CWSz.jpg', 'now_playing', '2023-08-25', 6.80, 285, '2023-10-04 20:52:45', '2023-10-04 20:54:13'),
(8, 820609, 'No One Will Save You', 'An exiled anxiety-ridden homebody must battle an alien who\'s found its way into her home.', '/ehGIDAMaYy6Eg0o8ga0oqflDjqW.jpg', '/zYlgqIpqJ1VAbvFhRhktAzIybVs.jpg', NULL, '2023-09-22', 7.00, 420, '2023-10-04 20:52:46', '2023-10-04 20:52:46'),
(9, 1008042, 'Talk to Me', 'When a group of friends discover how to conjure spirits using an embalmed hand, they become hooked on the new thrill, until one of them goes too far and unleashes terrifying supernatural forces.', '/kdPMUMJzyYAc4roD52qavX0nLIC.jpg', '/iIvQnZyzgx9TkbrOgcXx0p7aLiq.jpg', NULL, '2023-07-28', 7.20, 1022, '2023-10-04 20:52:47', '2023-10-04 20:52:47'),
(10, 346698, 'Barbie', 'Barbie and Ken are having the time of their lives in the colorful and seemingly perfect world of Barbie Land. However, when they get a chance to go to the real world, they soon discover the joys and perils of living among humans.', '/iuFNMS8U5cb6xfzi51Dbkovj7vM.jpg', '/ctMserH8g2SeOAnCw5gFjdQF8mo.jpg', 'now_playing', '2023-09-22', 7.30, 5203, '2023-10-04 20:52:48', '2023-10-04 20:54:13'),
(11, 1172009, 'The Black Book', 'After his son is wrongly accused of kidnapping, a deacon who has just lost his wife takes matters into his own hands and fights a crooked police gang to clear him.', '/kn28W24slBLyGr8ZIZnxNE5YZrY.jpg', '/9WxqnP9c29wXd03sALSpxpTx8fk.jpg', NULL, '2023-09-22', 7.80, 25, '2023-10-04 20:52:50', '2023-10-04 20:52:50'),
(12, 951491, 'Saw X', 'Between the events of \'Saw\' and \'Saw II\', a sick and desperate John Kramer travels to Mexico for a risky and experimental medical procedure in hopes of a miracle cure for his cancer, only to discover the entire operation is a scam to defraud the most vulnerable. Armed with a newfound purpose, the infamous serial killer returns to his work, turning the tables on the con artists in his signature visceral way through devious, deranged, and ingenious traps.', '/aQPeznSu7XDTrrdCtT5eLiu52Yu.jpg', '/dZbLqRjjiiNCpTYzhzL2NMvz4J0.jpg', 'now_playing', '2023-09-29', 7.40, 82, '2023-10-04 20:52:51', '2023-10-04 20:54:14'),
(13, 976573, 'Elemental', 'In a city where fire, water, land and air residents live together, a fiery young woman and a go-with-the-flow guy will discover something elemental: how much they have in common.', '/4Y1WNkd88JXmGfhtWR7dmDAo1T2.jpg', '/4fLZUr1e65hKPPVw0R3PmKFKxj1.jpg', NULL, '2023-06-16', 7.80, 2507, '2023-10-04 20:52:52', '2023-10-04 20:52:52'),
(14, 820525, 'After Everything', 'Besieged by writer’s block and the crushing breakup with Tessa, Hardin travels to Portugal in search of a woman he wronged in the past – and to find himself. Hoping to win back Tessa, he realizes he needs to change his ways before he can make the ultimate commitment.', '/fyuUJcUIsY0g5tHOC2UDmv1PiJL.jpg', '/jkKVLzLWjSvTnc84VzeljhSy6j8.jpg', 'now_playing', '2023-09-13', 6.50, 95, '2023-10-04 20:52:53', '2023-10-04 20:54:15'),
(15, 1171541, 'Sniper: G.R.I.T. - Global Response & Intelligence Team', 'When an international terrorist cult threatens global political stability and kidnaps a fellow agent, Ace Sniper Brandon Beckett and the newly-formed Global Response & Intelligence Team – or G.R.I.T. – led by Colonel Stone must travel across the world to Malta, infiltrate the cult, and take out its leader to free Lady Death and stop the global threat.', '/gcd5TJwXLWeQ2Dn0aRxI8OJIIxK.jpg', '/1DBo2V4KyBWXuagt4JOR2jZJMHB.jpg', NULL, '2023-09-26', 7.70, 18, '2023-10-04 20:52:54', '2023-10-04 20:52:54'),
(16, 1002338, 'Operation Napoleon', 'A modern-day lawyer is sucked into an international conspiracy after being accused of a murder she didn\'t commit. Her only chance of freedom lies in uncovering the secret of an old German WWII aeroplane, long buried deep beneath the ice, before the CIA.', '/j2Or0w69bpPXrmkE0hpTzw6hzsr.jpg', '/oghHR3X0hIcvs7xqyoFjA0GAZWn.jpg', NULL, '2023-08-11', 7.00, 25, '2023-10-04 20:52:55', '2023-10-04 20:52:55'),
(17, 575264, 'Mission: Impossible - Dead Reckoning Part One', 'Ethan Hunt and his IMF team embark on their most dangerous mission yet: To track down a terrifying new weapon that threatens all of humanity before it falls into the wrong hands. With control of the future and the world\'s fate at stake and dark forces from Ethan\'s past closing in, a deadly race around the globe begins. Confronted by a mysterious, all-powerful enemy, Ethan must consider that nothing can matter more than his mission—not even the lives of those he cares about most.', '/NNxYkU70HPurnNCSiCjYAmacwm.jpg', '/628Dep6AxEtDxjZoGP78TsOxYbK.jpg', NULL, '2023-07-12', 7.70, 1211, '2023-10-04 20:52:55', '2023-10-04 20:52:55'),
(18, 717930, 'Kandahar', 'After his mission is exposed, an undercover CIA operative stuck deep in hostile territory in Afghanistan must fight his way out, alongside his Afghan translator, to an extraction point in Kandahar, all whilst avoiding elite enemy forces and foreign spies tasked with hunting them down.', '/lCanGgsqF4xD2WA5NF8PWeT3IXd.jpg', '/c6Splshb8lb2Q9OvUfhpqXl7uP0.jpg', NULL, '2023-05-26', 6.90, 599, '2023-10-04 20:52:56', '2023-10-04 20:52:56'),
(19, 667538, 'Transformers: Rise of the Beasts', 'When a new threat capable of destroying the entire planet emerges, Optimus Prime and the Autobots must team up with a powerful faction known as the Maximals. With the fate of humanity hanging in the balance, humans Noah and Elena will do whatever it takes to help the Transformers as they engage in the ultimate battle to save Earth.', '/gPbM0MK8CP8A174rmUwGsADNYKD.jpg', '/2vFuG6bWGyQUzYS9d69E5l85nIz.jpg', NULL, '2023-06-09', 7.50, 3300, '2023-10-04 20:52:57', '2023-10-04 20:52:57'),
(20, 335977, 'Indiana Jones and the Dial of Destiny', 'Finding himself in a new era, and approaching retirement, Indy wrestles with fitting into a world that seems to have outgrown him. But as the tentacles of an all-too-familiar evil return in the form of an old rival, Indy must don his hat and pick up his whip once more to make sure an ancient and powerful artifact doesn\'t fall into the wrong hands.', '/Af4bXE63pVsb2FtbW8uYIyPBadD.jpg', '/35z8hWuzfFUZQaYog8E9LsXW3iI.jpg', NULL, '2023-06-30', 6.70, 1803, '2023-10-04 20:52:58', '2023-10-04 20:52:58'),
(21, 670292, 'The Creator', 'Amid a future war between the human race and the forces of artificial intelligence, a hardened ex-special forces agent grieving the disappearance of his wife, is recruited to hunt down and kill the Creator, the elusive architect of advanced AI who has developed a mysterious weapon with the power to end the war—and mankind itself.', '/vBZ0qvaRxqEhZwl6LWmruJqWE8Z.jpg', '/iQcCAm8hKWZyUntqrvzyEGtXyJl.jpg', 'now_playing', '2023-09-29', 7.20, 212, '2023-10-04 20:53:00', '2023-10-04 20:54:15'),
(22, 744278, 'Mondocane', 'In the near future, the southern Italian city of Taranto is surrounded by barbed wire that no one, not even the police, dares to cross. The poorest are left fighting for survival, while gangs compete for the territory. Two thirteen-year-old orphans who grew up together, dream of joining one of the gangs.', '/gOuJBz9u1YVWwvx12lJX56yUT6I.jpg', '/uAAAzo9efEZJJPtj4iNwFvrRaki.jpg', NULL, '2022-05-20', 6.40, 119, '2023-10-04 20:53:01', '2023-10-04 20:53:01'),
(23, 1076364, 'Carl\'s Date', 'Carl Fredricksen reluctantly agrees to go on a date with a lady friend—but admittedly has no idea how dating works these days. Ever the helpful friend, Dug steps in to calm Carl\'s pre-date jitters and offer some tried-and-true tips for making friends—if you\'re a dog.', '/y8NtM6q3PzntqyNRNw6wgicwRYl.jpg', '/iOJX54nVAsnPawagFiWXKv1Y6sB.jpg', NULL, '2023-06-16', 7.80, 205, '2023-10-04 20:53:02', '2023-10-04 20:53:02'),
(24, 569094, 'Spider-Man: Across the Spider-Verse', 'After reuniting with Gwen Stacy, Brooklyn’s full-time, friendly neighborhood Spider-Man is catapulted across the Multiverse, where he encounters the Spider Society, a team of Spider-People charged with protecting the Multiverse’s very existence. But when the heroes clash on how to handle a new threat, Miles finds himself pitted against the other Spiders and must set out on his own to save those he loves most.', '/8Vt6mWEReuy4Of61Lnj5Xj704m8.jpg', '/4HodYYKEIsGOdinkGi2Ucz6X9i0.jpg', NULL, '2023-06-02', 8.40, 4452, '2023-10-04 20:53:03', '2023-10-04 20:53:03'),
(25, 603692, 'John Wick: Chapter 4', 'With the price on his head ever increasing, John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.', '/vZloFAK7NmvMGKE7VkF5UHaz0I.jpg', '/7I6VUdPj6tQECNHdviJkUHD2u89.jpg', NULL, '2023-03-24', 7.80, 4667, '2023-10-04 20:53:04', '2023-10-04 20:53:04'),
(26, 1146348, 'Scooby-Doo! And Krypto, Too!', 'When the Justice League goes missing and villains overrun Metropolis, there\'s only one team that can solve this mystery: Scooby-Doo and the gang! But wait, there\'s a new dog in town – Krypto – Superman\'s Superdog with Super Powers. Mystery Inc. will need all the help it can get when phantoms menace the Justice League\'s headquarters.', '/ntMOnvlYYnio7Fx3xqBu9B1Sz7f.jpg', '/8UjwvrxTpsD46cDQklDdU14RQYB.jpg', NULL, '2023-09-26', 7.80, 20, '2023-10-04 20:53:04', '2023-10-04 20:53:04'),
(27, 298618, 'The Flash', 'When his attempt to save his family inadvertently alters the future, Barry Allen becomes trapped in a reality in which General Zod has returned and there are no Super Heroes to turn to. In order to save the world that he is in and return to the future that he knows, Barry\'s only hope is to race for his life. But will making the ultimate sacrifice be enough to reset the universe?', '/rktDFPbfHfUbArZ6OOOKsXcv0Bm.jpg', '/yF1eOkaYvwiORauRCPWznV9xVvi.jpg', NULL, '2023-06-16', 6.90, 2989, '2023-10-04 20:53:05', '2023-10-04 20:53:05'),
(28, 790493, 'Spy Kids: Armageddon', 'When the children of the world’s greatest secret agents unwittingly help a powerful game developer unleash a computer virus that gives him control of all technology, they must become spies themselves to save their parents and the world.', '/vd8YdaH7dzeIMGTNwQinlSiA1gV.jpg', '/6fKEw0I2FTD5FLOQ5q7L1tqf876.jpg', NULL, '2023-09-22', 6.60, 62, '2023-10-04 20:53:06', '2023-10-04 20:53:06'),
(29, 433499, 'Finding Steve McQueen', 'In 1972, a gang of close-knit thieves from Youngstown, Ohio attempt to steal $30 million in illegal contributions. Based on the true story of the biggest bank heist in US history.', '/uhmNHWTVniHHYKTsWSvSir19K1z.jpg', '/voFUDCuXSGiZvV0esx6uQqWBH8h.jpg', NULL, '2019-03-15', 6.30, 98, '2023-10-04 20:53:07', '2023-10-04 20:53:07'),
(30, 872585, 'Oppenheimer', 'The story of J. Robert Oppenheimer’s role in the development of the atomic bomb during World War II.', '/8Gxv8gSFCU0XGDykEGv7zR1n2ua.jpg', '/fm6KqXpk3M2HVveHwCrBSSBaO0V.jpg', NULL, '2023-07-21', 8.30, 3796, '2023-10-04 20:53:08', '2023-10-04 20:53:08'),
(31, 502356, 'The Super Mario Bros. Movie', 'While working underground to fix a water main, Brooklyn plumbers—and brothers—Mario and Luigi are transported down a mysterious pipe and wander into a magical new world. But when the brothers are separated, Mario embarks on an epic quest to find Luigi.', '/qNBAXBIQlnOThrVvA6mA2B5ggV6.jpg', '/9n2tJBplPbgR2ca05hS5CKXwP2c.jpg', 'now_playing', '2023-08-27', 7.80, 6779, '2023-10-04 20:53:09', '2023-10-04 20:54:16'),
(32, 983793, 'Mojave Diamonds', 'A former MMA fighter and his brothers must rescue their kidnapped family from a dangerous crime syndicate after $50M of illegal diamonds gets stolen.', '/eauJLqzFy53KR86VNXnzz3wsD6w.jpg', '/dPagCvFuFWKEoEcjTGwwrdpdTPp.jpg', NULL, '2023-05-30', 4.00, 2, '2023-10-04 20:53:10', '2023-10-04 20:53:10'),
(33, 614930, 'Teenage Mutant Ninja Turtles: Mutant Mayhem', 'After years of being sheltered from the human world, the Turtle brothers set out to win the hearts of New Yorkers and be accepted as normal teenagers through heroic acts. Their new friend April O\'Neil helps them take on a mysterious crime syndicate, but they soon get in over their heads when an army of mutants is unleashed upon them.', '/ueO9MYIOHO7M1PiMUeX74uf8fB9.jpg', '/w2nFc2Rsm93PDkvjY4LTn17ePO0.jpg', NULL, '2023-08-02', 7.30, 683, '2023-10-04 20:53:11', '2023-10-04 20:53:11'),
(34, 439079, 'The Nun', 'A priest with a haunted past and a novice on the threshold of her final vows are sent by the Vatican to investigate the death of a young nun in Romania and confront a malevolent force in the form of a demonic nun.', '/sFC1ElvoKGdHJIWRpNB3xWJ9lJA.jpg', '/fgsHxz21B27hOOqQBiw9L6yWcM7.jpg', NULL, '2018-09-07', 5.90, 6103, '2023-10-04 20:53:12', '2023-10-04 20:53:12'),
(35, 299054, 'Expend4bles', 'Armed with every weapon they can get their hands on and the skills to use them, The Expendables are the world’s last line of defense and the team that gets called when all other options are off the table. But new team members with new styles and tactics are going to give “new blood” a whole new meaning.', '/nLOw900kDcbvsSs5YshUXRvWS0Z.jpg', '/rMvPXy8PUjj1o8o1pzgQbdNCsvj.jpg', 'now_playing', '2023-09-22', 6.60, 99, '2023-10-04 20:53:13', '2023-10-04 20:54:16'),
(36, 447365, 'Guardians of the Galaxy Vol. 3', 'Peter Quill, still reeling from the loss of Gamora, must rally his team around him to defend the universe along with protecting one of their own. A mission that, if not completed successfully, could quite possibly lead to the end of the Guardians as we know them.', '/r2J02Z2OpNTctfOSN1Ydgii51I3.jpg', '/5YZbUmjbMa3ClvSW1Wj3D6XGolb.jpg', NULL, '2023-05-05', 8.00, 4983, '2023-10-04 20:53:14', '2023-10-04 20:53:14'),
(37, 176, 'Saw', 'Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...', '/4da0TS3iQ1IzuyhDS8elgkmOfrN.jpg', '/ok4ot3YbfDYZcINXf91JUfq3maB.jpg', NULL, '2004-10-29', 7.40, 8356, '2023-10-04 20:53:15', '2023-10-04 20:53:15'),
(38, 807172, 'The Exorcist: Believer', 'Since the death of his wife 12 years ago, Victor Fielding has raised their daughter, Angela on his own. But when Angela and her friend Katherine disappear in the woods, only to return three days later with no memory of what happened to them, it unleashes a chain of events that will force Victor to confront the nadir of evil and, in his terror and desperation, seek out the only person alive who has witnessed anything like it before: Chris MacNeil.', '/qVKirUdmoex8SdfUk8WDDWwrcCh.jpg', '/f33XdT6dwNXmXQNvQ4FuyhQrUob.jpg', 'now_playing', '2023-10-06', 7.20, 6, '2023-10-04 20:53:16', '2023-10-04 20:54:16'),
(39, 447277, 'The Little Mermaid', 'The youngest of King Triton’s daughters, and the most defiant, Ariel longs to find out more about the world beyond the sea, and while visiting the surface, falls for the dashing Prince Eric. With mermaids forbidden to interact with humans, Ariel makes a deal with the evil sea witch, Ursula, which gives her a chance to experience life on land, but ultimately places her life – and her father’s crown – in jeopardy.', '/ym1dxyOk4jFcSl4Q2zmRrA5BEEN.jpg', '/7VEUOEfRzzrQfWddlIyLUKvh6Nf.jpg', 'now_playing', '2023-08-25', 6.50, 2172, '2023-10-04 20:53:17', '2023-10-04 20:54:17'),
(40, 912908, 'Strays', 'When Reggie is abandoned on the mean city streets by his lowlife owner, Doug, Reggie is certain that his beloved owner would never leave him on purpose. But once Reggie falls in with Bug, a fast-talking, foul-mouthed stray who loves his freedom and believes that owners are for suckers, Reggie finally realizes he was in a toxic relationship and begins to see Doug for the heartless sleazeball that he is.', '/n1hqbSCtyBAxaXEl1Dj3ipXJAJG.jpg', '/1HzL603WOer58xtnrRYdSIL5K04.jpg', NULL, '2023-08-18', 7.50, 402, '2023-10-04 20:53:18', '2023-10-04 20:53:18'),
(41, 1010581, 'My Fault', 'Noah must leave her city, boyfriend, and friends to move into William Leister\'s mansion, the flashy and wealthy husband of her mother Rafaela. As a proud and independent 17 year old, Noah resists living in a mansion surrounded by luxury. However, it is there where she meets Nick, her new stepbrother, and the clash of their strong personalities becomes evident from the very beginning.', '/w46Vw536HwNnEzOa7J24YH9DPRS.jpg', '/lntyt4OVDbcxA1l7LtwITbrD3FI.jpg', NULL, '2023-06-08', 8.10, 1753, '2023-10-04 20:53:19', '2023-10-04 20:53:19'),
(42, 1126577, 'Til Death Do Us Part', 'After bailing on her wedding, a former bride-to-be must fight off her ex-groom and seven angry killer groomsmen in order to survive the night.', '/2JSsduIaJzlScVunHCc6KYBIOjY.jpg', '/ffQAbMDcME2IFmdnzCrbDjEupM.jpg', NULL, '2023-08-04', 6.20, 31, '2023-10-04 20:53:20', '2023-10-04 20:53:20'),
(43, 1152797, 'Freestyle', 'Trying to check out a recording from his debut album, a street rapper and his friend run into trouble when a major drug deal turns into a total disaster for them.', '/hNPJzlPlIVgTAjb2Mgqwl1QqydK.jpg', '/xsnpgM2Si1hG7daLP1XE7uAfKKH.jpg', NULL, '2023-09-13', 6.70, 36, '2023-10-04 20:53:21', '2023-10-04 20:53:21'),
(44, 734253, 'Adipurush', '7000 years ago, Ayodhya\'s Prince Raghava and Prince Sesh along with the Mighty Vanar Warriors travels to the island of Lanka with an aim to rescue Raghava\'s wife Janaki, who has been abducted by Lankesh, the king of Lanka.', '/bNY8xxtLm0HtdPS0kBttK3WKGQf.jpg', '/2QL5j6mB4ZpyBcVr0WO9H9MQGBu.jpg', NULL, '2023-06-16', 5.60, 54, '2023-10-04 20:53:22', '2023-10-04 20:53:22'),
(45, 724209, 'Heart of Stone', 'An intelligence operative for a shadowy global peacekeeping agency races to stop a hacker from stealing its most valuable — and dangerous — weapon.', '/vB8o2p4ETnrfiWEgVxHmHWP9yRl.jpg', '/xVMtv55caCEvBaV83DofmuZybmI.jpg', NULL, '2023-08-09', 6.90, 1184, '2023-10-04 20:53:23', '2023-10-04 20:53:23'),
(46, 866463, 'Reptile', 'Following the brutal murder of a young real estate agent, a hardened detective attempts to uncover the truth in a case where nothing is as it seems, and by doing so dismantles the illusions in his own life.', '/soIgqZBoTiTgMqUW0JtxsPWAilQ.jpg', '/nrp2khEM6JWFqqNLeub1J6Qafe0.jpg', 'now_playing', '2023-09-29', 7.20, 128, '2023-10-04 20:53:24', '2023-10-04 20:54:17'),
(47, 1017335, 'Project Legion', 'A former marine awakens to an apocalyptic sight outside of his window and barricades himself from evil creatures that surround his apartment door and terrorize the city.', '/vEfbuchWvISRpqwEUHoxwuxdF0O.jpg', '/rpMmmKi9M89DhX9F5QeEZBwHKFL.jpg', NULL, '2022-10-07', 3.90, 11, '2023-10-04 20:53:24', '2023-10-04 20:53:24'),
(48, 1081676, 'Forgotten Love', 'A once-respected surgeon who\'s lost his family and his memory gets a chance at redemption when he reconnects with someone from his forgotten past.', '/tqXqhp0MaDi0SkcN20iNuobXIKs.jpg', '/j1bOCozOQOxJpk0iAQbJDS2w8OJ.jpg', NULL, '2023-09-27', 8.30, 51, '2023-10-04 20:53:25', '2023-10-04 20:53:25'),
(49, 1151534, 'Nowhere', 'A young pregnant woman named Mia escapes from a country at war by hiding in a maritime container aboard a cargo ship. After a violent storm, Mia gives birth to the child while lost at sea, where she must fight to survive.', '/rpzFxv78UvYG5yQba2soO5mMl4T.jpg', '/xvzxqKWltnj6qSiWBXRq6ZCdcrw.jpg', NULL, '2023-09-29', 7.90, 320, '2023-10-04 20:53:26', '2023-10-04 20:53:26'),
(50, 814776, 'Bottoms', 'Unpopular best friends PJ and Josie start a high school self-defense club to meet girls and lose their virginity. They soon find themselves in over their heads when the most popular students start beating each other up in the name of self-defense.', '/jeyTQrNEpyE1LZIgVlswYh3sc34.jpg', '/f9ErVXAyR9EP5WOOp4i5ivBKsKC.jpg', 'now_playing', '2023-08-25', 7.10, 87, '2023-10-04 20:53:27', '2023-10-04 20:54:18'),
(51, 1880, 'Red Dawn', 'It is the dawn of World War III. In mid-western America, a group of teenagers band together to defend their town—and their country—from invading Soviet forces.', '/a2GkHcioc2QEFJbQk1NTB85u3vD.jpg', '/9fOfsVHZHig6MHPHczv0zMY6cKc.jpg', NULL, '1984-08-10', 6.30, 692, '2023-10-04 20:53:28', '2023-10-04 20:53:28'),
(52, 923939, 'The Wonderful Story of Henry Sugar', 'A rich man learns about a guru who can see without using his eyes. He sets out to master the skill in order to cheat at gambling.', '/A4LTXT8MMZIr4aIwhE4qbGFivBo.jpg', '/dS4JR8gmj8UnamjuLEyAkEFoppy.jpg', 'now_playing', '2023-09-20', 7.40, 233, '2023-10-04 20:53:29', '2023-10-04 20:54:18'),
(53, 76600, 'Avatar: The Way of Water', 'Set more than a decade after the events of the first film, learn the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.', '/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', '/8rpDcsfLJypbO6vREc0547VKqEv.jpg', NULL, '2022-12-16', 7.70, 9856, '2023-10-04 20:53:30', '2023-10-04 20:53:30'),
(54, 965244, 'Ghost in the Shell: SAC_2045 Sustainable War', 'In the year 2045, after an economic disaster known as the Synchronized Global Default, rapid developments in AI propelled the world to enter a state of \"Sustainable War\". However, the public is not aware of the threat that AI has towards the human race.  A compilation film with newly added footage.', '/kNTvGWDTxb2spAp9SRLNfOo7kCM.jpg', '/htLu9YpLJCXk56GAHuFDnj8oadV.jpg', NULL, '2022-05-09', 7.30, 32, '2023-10-04 20:53:31', '2023-10-04 20:53:31'),
(55, 900667, 'One Piece Film Red', 'Uta — the most beloved singer in the world. Her voice, which she sings with while concealing her true identity, has been described as “otherworldly.” She will appear in public for the first time at a live concert. As the venue fills with all kinds of Uta fans — excited pirates, the Navy watching closely, and the Straw Hats led by Luffy who simply came to enjoy her sonorous performance — the voice that the whole world has been waiting for is about to resound.', '/ogDXuVkO92GcETZfSofXXemw7gb.jpg', '/A3m5GJu5kzAKK2wkGlzErlCCElT.jpg', NULL, '2022-11-04', 7.30, 736, '2023-10-04 20:53:31', '2023-10-04 20:53:31'),
(56, 1167725, 'Love Is in the Air', 'A fiercely independent pilot fighting to keep her family business afloat starts to fall for the man sent by corporate to ground her operation forever.', '/cAn1tvopkqATQ0AfV4LK08ReAvp.jpg', '/kZvYVhYYVL4MxLbDeBo9QJd0LRh.jpg', NULL, '2023-09-28', 6.10, 29, '2023-10-04 20:53:32', '2023-10-04 20:53:32'),
(57, 939335, 'Muzzle', 'LAPD K-9 officer Jake Rosser has just witnessed the shocking murder of his dedicated partner by a mysterious assailant. As he investigates the shooter’s identity, he uncovers a vast conspiracy that has a chokehold on the city in this thrilling journey through the tangled streets of Los Angeles and the corrupt bureaucracy of the LAPD.', '/qXChf7MFL36BgoLkiB3BzXiwW82.jpg', '/eSsMzJpzAwCa69tm6Wco2il44aJ.jpg', 'now_playing', '2023-09-29', 6.50, 12, '2023-10-04 20:53:33', '2023-10-04 20:54:18'),
(58, 884605, 'No Hard Feelings', 'On the brink of losing her childhood home, Maddie discovers an intriguing job listing: wealthy helicopter parents looking for someone to “date” their introverted 19-year-old son, Percy, before he leaves for college. To her surprise, Maddie soon discovers the awkward Percy is no sure thing.', '/gD72DhJ7NbfxvtxGiAzLaa0xaoj.jpg', '/rRcNmiH55Tz0ugUsDUGmj8Bsa4V.jpg', NULL, '2023-06-23', 7.20, 1422, '2023-10-04 20:53:34', '2023-10-04 20:53:34'),
(59, 156022, 'The Equalizer', 'McCall believes he has put his mysterious past behind him and dedicated himself to beginning a new, quiet life. But when he meets Teri, a young girl under the control of ultra-violent Russian gangsters, he can’t stand idly by – he has to help her. Armed with hidden skills that allow him to serve vengeance against anyone who would brutalize the helpless, McCall comes out of his self-imposed retirement and finds his desire for justice reawakened. If someone has a problem, if the odds are stacked against them, if they have nowhere else to turn, McCall will help. He is The Equalizer.', '/9u4yW7yPA0BQ2pv9XwiNzItwvp8.jpg', '/wHytVsfAZsVDAcABd6iQGmE2j29.jpg', NULL, '2014-09-26', 7.20, 8155, '2023-10-04 20:53:35', '2023-10-04 20:53:35'),
(60, 635910, 'The Last Voyage of the Demeter', 'The crew of the merchant ship Demeter attempts to survive the ocean voyage from Carpathia to London as they are stalked each night by a merciless presence onboard the ship.', '/nrtbv6Cew7qC7k9GsYSf5uSmuKh.jpg', '/qEm4FrkGh7kGoEiBOyGYNielYVc.jpg', NULL, '2023-08-11', 7.30, 745, '2023-10-04 20:53:36', '2023-10-04 20:53:36'),
(61, 614479, 'Insidious: The Red Door', 'To put their demons to rest once and for all, Josh Lambert and a college-aged Dalton Lambert must go deeper into The Further than ever before, facing their family\'s dark past and a host of new and more horrifying terrors that lurk behind the red door.', '/d07phJqCx6z5wILDYqkyraorDPi.jpg', '/hPcP1kv6vrkRmQO3YgV1H97FE5Q.jpg', NULL, '2023-07-07', 6.90, 1173, '2023-10-04 20:53:37', '2023-10-04 20:53:37'),
(62, 811076, 'Barbarians', 'A civilized dinner party in a country house sees four friends, Lucas, Adam, Chloe, and Eve, coming together for a birthday celebration. As the night progresses secrets and lies force themselves into the light and polite pretensions are dropped.  A knock at the door reveals three masked intruders with an agenda of their own.  Will their friendship stand the test? Can they survive the night or will their secrets eventually catch up with them?', '/6dSolFhaf5JOQjgwKCYnEoeJB8z.jpg', '/r3i7iTIVSSQtW7TdglUyIREWJCF.jpg', NULL, '2021-09-23', 5.40, 42, '2023-10-04 20:53:38', '2023-10-04 20:53:38'),
(63, 315162, 'Puss in Boots: The Last Wish', 'Puss in Boots discovers that his passion for adventure has taken its toll: He has burned through eight of his nine lives, leaving him with only one life left. Puss sets out on an epic journey to find the mythical Last Wish and restore his nine lives.', '/kuf6dutpsT0vSVehic3EZIqkOBt.jpg', '/b1Y8SUb12gPHCSSSNlbX4nB3IKy.jpg', NULL, '2022-12-21', 8.30, 6417, '2023-10-04 20:53:39', '2023-10-04 20:53:39'),
(64, 990140, 'Sakra', 'Qiao Feng is the respected leader of a roving band of martial artists. After he is wrongfully accused of murder and subsequently exiled, Qiao Feng goes on the run in search of answers about his own mysterious origin story—and the unknown enemies working to destroy him from the shadows.', '/jGKCpt3zzbGZbgoza6HCvecqElM.jpg', '/rV56FkcHkzHJcBOOqoCeSDnoBff.jpg', NULL, '2023-04-14', 6.60, 110, '2023-10-04 20:53:40', '2023-10-04 20:53:40'),
(65, 818511, 'Overhaul', 'When truck racer Roger loses everything, he receives a tempting but dangerous offer: to work as the getaway driver for a gang of thieves.', '/6yx14lSACNJ2zRoYyXqecf3QNgr.jpg', '/efro4duB7agkA2Xl5LmkD3HeCim.jpg', NULL, '2023-09-27', 6.80, 49, '2023-10-04 20:53:41', '2023-10-04 20:53:41'),
(66, 215, 'Saw II', 'When a new murder victim is discovered with all the signs of Jigsaw\'s hand, Detective Eric Matthews begins a full investigation and apprehends Jigsaw with little effort. But for Jigsaw, getting caught is just another part of his plan. Eight more of his victims are already fighting for their lives and now it\'s time for Matthews to join the game.', '/gTnaTysN8HsvVQqTRUh8m35mmUA.jpg', '/1lWeIA03iGXTlDv0yzsN0wUdT9T.jpg', NULL, '2005-10-28', 6.60, 4805, '2023-10-04 20:53:41', '2023-10-04 20:53:41'),
(67, 10726, 'American Psycho II: All American Girl', 'Rachel is a criminology student hoping to land a position as a teacher\'s assistant for professor Robert Starkman. She\'s sure this position will pave the way to an FBI career, and she\'s willing to do anything to obtain it -- including killing her classmates. The school psychiatrist, Dr. Daniels, becomes aware that Rachel is insane, but Rachel is skilled at her dangerous game of death and identity theft.', '/x4bYbE78GONxAWqke5rmhpKfR7e.jpg', '/bck1APsiyOtEniGLsFO0Gu8QtUU.jpg', NULL, '2002-04-22', 4.50, 357, '2023-10-04 20:53:42', '2023-10-04 20:53:42'),
(68, 42994, 'Memories', 'In this anime anthology, a salvage ship crew happens upon a haunted vessel in \"Magnetic Rose\"; a cold tablet turns a lab worker into a biological weapon in \"Stink Bomb\"; and an urban populace carries on an endless war with an unseen foe in \"Cannon Fodder.\"', '/2e3rs7ZZxf6ENkWcxkOYnq0xuXf.jpg', '/5eHsU7ZhDiiWaeSRWojqsaqaq7n.jpg', NULL, '1997-07-23', 7.40, 367, '2023-10-04 20:53:43', '2023-10-04 20:53:43'),
(69, 1040148, 'Ruby Gillman, Teenage Kraken', 'Ruby Gillman, a sweet and awkward high school student, discovers she\'s a direct descendant of the warrior kraken queens. The kraken are sworn to protect the oceans of the world against the vain, power-hungry mermaids. Destined to inherit the throne from her commanding grandmother, Ruby must use her newfound powers to protect those she loves most.', '/kgrLpJcLBbyhWIkK7fx1fM4iSvf.jpg', '/f7UI3dYpr7ZUHGo0iIr1Qvy1VPe.jpg', NULL, '2023-06-30', 7.50, 681, '2023-10-04 20:53:44', '2023-10-04 20:53:44'),
(70, 893723, 'PAW Patrol: The Mighty Movie', 'A magical meteor crash-lands in Adventure City, gives the PAW Patrol pups superpowers, and transforms them into The Mighty Pups. When the Patrol\'s archrival Humdinger breaks out of jail and teams up with mad scientist Victoria Vance to steal the powers for themselves, the Mighty Pups must save Adventure City and stop the supervillains before it\'s too late.', '/oXnSu4raRAd65QVBQXvdHMC6AuW.jpg', '/fwXeTKmJvlv7kbH8QDmbykGfMeK.jpg', 'now_playing', '2023-09-29', 7.50, 20, '2023-10-04 20:53:45', '2023-10-04 20:54:19'),
(71, 1172674, 'The Rat Catcher', 'In an English village, a reporter and a mechanic listen to a ratcatcher explain his clever plan to outwit his prey.', '/29WJ7dOHt48AtXK1J1rONEEvIMN.jpg', '/aQuzqump4Zjh2bCoymZ2POLlNYt.jpg', NULL, '2023-09-29', 6.80, 71, '2023-10-04 20:53:46', '2023-10-04 20:53:46'),
(72, 459003, 'Mavka: The Forest Song', 'Mavka — a Soul of the Forest and its Warden — faces an impossible choice between love and her duty as guardian to the Heart of the Forest, when she falls in love with a human — the talented young musician Lukas.', '/eeJjd9JU2Mdj9d7nWRFLWlrcExi.jpg', '/vT17lPUglrAzjEqMwjPpIDe49ty.jpg', NULL, '2023-08-15', 7.40, 405, '2023-10-04 20:53:47', '2023-10-04 20:53:47'),
(73, 496450, 'Miraculous: Ladybug & Cat Noir, The Movie', 'A life of an ordinary Parisian teenager Marinette goes superhuman when she becomes Ladybug. Bestowed with magical powers of creation, Ladybug must unite with her opposite, Cat Noir, to save Paris as a new villain unleashes chaos unto the city.', '/bBON9XO9Ek0DjRwMBnJNCwC96Cd.jpg', '/iEFuHjqrE059SmflBva1JzDJutE.jpg', NULL, '2023-07-21', 7.80, 597, '2023-10-04 20:53:48', '2023-10-04 20:53:48'),
(74, 1083862, 'Resident Evil: Death Island', 'In San Francisco, Jill Valentine is dealing with a zombie outbreak and a new T-Virus, Leon Kennedy is on the trail of a kidnapped DARPA scientist, and Claire Redfield is investigating a monstrous fish that is killing whales in the bay. Joined by Chris Redfield and Rebecca Chambers, they discover the trail of clues from their separate cases all converge on the same location, Alcatraz Island, where a new evil has taken residence and awaits their arrival.', '/qayga07ICNDswm0cMJ8P3VwklFZ.jpg', '/7drO1kYgQ0PnnU87sAnBEphYrSM.jpg', NULL, '2023-07-25', 7.60, 697, '2023-10-04 20:53:48', '2023-10-04 20:53:48'),
(75, 1164486, 'Rick and Morty: The Great Yokai Battle of Akihabara', '', '/7aCOzT1lLtfOzHni8xIe4dbpEwC.jpg', '/tCI7EP8IBdeV4BR05zmzW3JIjwx.jpg', NULL, '2021-01-01', 6.50, 1, '2023-10-04 20:53:49', '2023-10-04 20:53:49'),
(76, 1142740, 'Murder City', 'A disgraced former cop finds himself working for a ruthless female kingpin to pay off his estranged father’s debt and protect his family.', '/gZ1YbdkwyTCmVxZxh1otFnMEnOs.jpg', '/j7FwgVFjpsToIJ5Lt5y2K4N5pKm.jpg', NULL, '2023-06-29', 7.40, 5, '2023-10-04 20:53:50', '2023-10-04 20:53:50'),
(77, 1032666, 'Bunker', 'Trapped in a bunker during World War I, a group of soldiers are faced with an ungodly presence that slowly turns them against each other.', '/jOA7chFPVzSyPp2DaRg8hqA1BHr.jpg', '/xfa49EDtKvs2yC9l4xroKtKlrcc.jpg', NULL, '2022-10-08', 7.60, 12, '2023-10-04 20:53:51', '2023-10-04 20:53:51'),
(78, 1006462, 'The Flood', 'A horde of giant hungry alligators is unleashed on a group of in-transit prisoners and their guards after a massive hurricane floods Louisiana.', '/mvjqqklMpHwOxc40rn7dMhGT0Fc.jpg', '/1O9Rio3RCT4eZVJH3znI8VbGexq.jpg', NULL, '2023-07-14', 6.80, 206, '2023-10-04 20:53:52', '2023-10-04 20:53:52'),
(79, 246355, 'Saw', 'David, an orderly at a hospital, tells his horrific story of being kidnapped and forced to play a vile game of survival.', '/uvjBl6LHmb5JpAbmSZzeWA1c7Sv.jpg', '/8d2s5MP8mc1OXaq7zn6PHv9kWY4.jpg', NULL, '2003-10-30', 7.00, 503, '2023-10-04 20:53:53', '2023-10-04 20:53:53'),
(80, 1001811, 'My Big Fat Greek Wedding 3', 'Following the death of their patriarch Gus, the Portokalos family travels to Greece for a family reunion, and to deliver Gus\' journal to his old friends.', '/irEqWPmDqCuzsItzefFxX3xWpL8.jpg', '/eiIvFiqOClwNX3nUmRlEmNarFCk.jpg', 'now_playing', '2023-09-08', 6.50, 37, '2023-10-04 20:53:54', '2023-10-04 20:54:19'),
(81, 979275, 'Mob Land', 'A sheriff tries to keep the peace when a desperate family man violently robs a pill mill with his brother-in-law, alerting an enforcer for the New Orleans mafia.', '/mcz8oi9oCgq1wkA3Wz2kluE94pE.jpg', '/3mrli3xsGrAieQks7KsBUm2LpCg.jpg', NULL, '2023-08-04', 5.80, 37, '2023-10-04 20:53:55', '2023-10-04 20:53:55'),
(82, 866346, 'The Retirement Plan', 'When Ashley and her young daughter Sarah get caught up in a criminal enterprise that puts their lives at risk, she turns to the only person who can help: her estranged father Matt, currently living the life of a retired beach bum in the Cayman Islands. Their reunion is fleeting as they are soon tracked down on the island by crime boss Donnie and his lieutenant Bobo. As Ashley, Sarah, and Matt become entangled in an increasingly dangerous web, Ashley quickly learns her father had a secret past that she knew nothing about and that there is more to her father than meets the eye.', '/kv4n3xgRWtkldaD4kyy1FvpW6bO.jpg', '/436mzGC6sSM1YsHxdtHD6jVtGxX.jpg', 'now_playing', '2023-09-15', 6.00, 30, '2023-10-04 20:53:56', '2023-10-04 20:54:19'),
(83, 634649, 'Spider-Man: No Way Home', 'Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.', '/5weKu49pzJCt06OPpjvT80efnQj.jpg', '/14QbnygCuTO0vl7CAFmPf1fgZfV.jpg', NULL, '2021-12-17', 8.00, 18313, '2023-10-04 20:53:56', '2023-10-04 20:53:56'),
(84, 1076487, 'Warhorse One', 'A gunned down Navy SEAL Master Chief must guide a child to safety through a gauntlet of hostile Taliban insurgents and survive the brutal Afghanistan wilderness.', '/jP2ik17jvKiV5sGEknMFbZv7WAe.jpg', '/J0XkW5toJLGEucm1pLDvTHXaKC.jpg', NULL, '2023-06-30', 7.20, 180, '2023-10-04 20:53:57', '2023-10-04 20:53:57'),
(85, 1002185, 'A Million Miles Away', 'The life of engineer and former NASA astronaut José M. Hernández, the first migrant farmworker to go to space.', '/kMI3tgxLAZbzGOVlorUBva0kriS.jpg', '/23HvwdsAQeL0MxN9fm3d8m1NaPw.jpg', 'now_playing', '2023-09-08', 8.00, 187, '2023-10-04 20:53:58', '2023-10-04 20:54:20'),
(86, 214, 'Saw III', 'Jigsaw has disappeared. Along with his new apprentice Amanda, the puppet-master behind the cruel, intricate games that have terrified a community and baffled police has once again eluded capture and vanished. While city detective scrambles to locate him, Doctor Lynn Denlon and Jeff Reinhart are unaware that they are about to become the latest pawns on his vicious chessboard.', '/1k2mz5IEyDUU4iG4KMbTQMnxrMD.jpg', '/qx8Pb3nVnHLBizI9792pbRN5nnm.jpg', NULL, '2006-10-27', 6.40, 4024, '2023-10-04 20:53:59', '2023-10-04 20:53:59'),
(87, 455476, 'Knights of the Zodiac', 'When a headstrong street orphan, Seiya, in search of his abducted sister unwittingly taps into hidden powers, he discovers he might be the only person alive who can protect a reincarnated goddess, sent to watch over humanity. Can he let his past go and embrace his destiny to become a Knight of the Zodiac?', '/qW4crfED8mpNDadSmMdi7ZDzhXF.jpg', '/oqP1qEZccq5AD9TVTIaO6IGUj7o.jpg', NULL, '2023-05-12', 6.60, 834, '2023-10-04 20:54:00', '2023-10-04 20:54:00'),
(88, 744276, 'After Ever Happy', 'As a shocking truth about a couple\'s families emerges, the two lovers discover they are not so different from each other. Tessa is no longer the sweet, simple, good girl she was when she met Hardin — any more than he is the cruel, moody boy she fell so hard for.', '/moogpu8rNkEjTgFyLXwhPghft5w.jpg', '/rwgmDkIEv8VjAsWx25ottJrFvpO.jpg', NULL, '2022-09-07', 6.80, 998, '2023-10-04 20:54:01', '2023-10-04 20:54:01'),
(89, 882569, 'Guy Ritchie\'s The Covenant', 'During the war in Afghanistan, a local interpreter risks his own life to carry an injured sergeant across miles of grueling terrain.', '/kVG8zFFYrpyYLoHChuEeOGAd6Ru.jpg', '/eTvN54pd83TrSEOz6wbsXEJktCV.jpg', NULL, '2023-04-21', 7.80, 1662, '2023-10-04 20:54:01', '2023-10-04 20:54:01'),
(90, 14836, 'Coraline', 'A young girl discovers an idealized parallel universe behind a secret door in her new home, unaware that it contains a sinister secret.', '/4jeFXQYytChdZYE9JYO7Un87IlW.jpg', '/8GHxjXlI5rqyTBuVNekGTPjG5T6.jpg', NULL, '2009-02-06', 7.90, 6963, '2023-10-04 20:54:02', '2023-10-04 20:54:02'),
(91, 663, 'Saw IV', 'Jigsaw and his apprentice Amanda are dead. Now, upon the news of Detective Kerry\'s murder, two seasoned FBI profilers, Agent Strahm and Agent Perez, arrive in the terrified community to assist the veteran Detective Hoffman in sifting through Jigsaw\'s latest grisly remains and piecing together the puzzle. However, when SWAT Commander Rigg is abducted and thrust into a game, the last officer untouched by Jigsaw has but ninety minutes to overcome a series of demented traps and save an old friend...or face the deadly consequences.', '/e3pLI0qN1AKGHwOcMuwTpyI2SLN.jpg', '/yi0tfJBw9icvlWTXvjLqpEeSTia.jpg', NULL, '2007-10-26', 6.20, 3359, '2023-10-04 20:54:03', '2023-10-04 20:54:03'),
(92, 697843, 'Extraction 2', 'Tasked with extracting a family who is at the mercy of a Georgian gangster, Tyler Rake infiltrates one of the world\'s deadliest prisons in order to save them. But when the extraction gets hot, and the gangster dies in the heat of battle, his equally ruthless brother tracks down Rake and his team to Vienna, in order to get revenge.', '/7gKI9hpEMcZUQpNgKrkDzJpbnNS.jpg', '/wRxLAw4l17LqiFcPLkobriPTZAw.jpg', NULL, '2023-06-09', 7.50, 1826, '2023-10-04 20:54:04', '2023-10-04 20:54:04'),
(93, 602734, 'Spiral: From the Book of Saw', 'Working in the shadow of an esteemed police veteran, brash Detective Ezekiel “Zeke” Banks and his rookie partner take charge of a grisly investigation into murders that are eerily reminiscent of the city’s gruesome past.  Unwittingly entrapped in a deepening mystery, Zeke finds himself at the center of the killer’s morbid game.', '/qkl6mRoFexK2FGWCbAsvrRxjWaF.jpg', '/g15PR8eQV9DehSWlagvdnJZqoRq.jpg', NULL, '2021-05-14', 6.00, 1666, '2023-10-04 20:54:05', '2023-10-04 20:54:05'),
(94, 758323, 'The Pope\'s Exorcist', 'Father Gabriele Amorth, Chief Exorcist of the Vatican, investigates a young boy\'s terrifying possession and ends up uncovering a centuries-old conspiracy the Vatican has desperately tried to keep hidden.', '/jFC4LS5qTAT3PinzdEzINfu1CV9.jpg', '/hiHGRbyTcbZoLsYYkO4QiCLYe34.jpg', NULL, '2023-04-14', 7.10, 1985, '2023-10-04 20:54:06', '2023-10-04 20:54:06'),
(95, 985883, 'Do Not Disturb', 'A middle-aged man emerges from a pandemic slump with a new job at a quiet hotel, until some eccentric guests turn his first night into a wild adventure.', '/AdcXd3zgbtoo2EDn3ymp35gdZoH.jpg', '/wY3iXVwRsLR13fvHO50AazoWMQ8.jpg', NULL, '2023-09-29', 7.10, 15, '2023-10-04 20:54:07', '2023-10-04 20:54:07'),
(96, 41439, 'Saw 3D', 'As a deadly battle rages over Jigsaw\'s brutal legacy, a group of Jigsaw survivors gathers to seek the support of self-help guru and fellow survivor Bobby Dagen, a man whose own dark secrets unleash a new wave of terror.', '/qHCZ6LjtmqWDfXXN28TlIC9OppK.jpg', '/xueYI4YoaXIzZ1mxZrs4FWImUCd.jpg', NULL, '2010-10-29', 6.00, 2671, '2023-10-04 20:54:08', '2023-10-04 20:54:08'),
(97, 354912, 'Coco', 'Despite his family’s baffling generations-old ban on music, Miguel dreams of becoming an accomplished musician like his idol, Ernesto de la Cruz. Desperate to prove his talent, Miguel finds himself in the stunning and colorful Land of the Dead following a mysterious chain of events. Along the way, he meets charming trickster Hector, and together, they set off on an extraordinary journey to unlock the real story behind Miguel\'s family history.', '/gGEsBPAijhVUFoiNpgZXqRVWJt2.jpg', '/askg3SMvhqEl4OL52YuvdtY40Yb.jpg', NULL, '2017-11-22', 8.20, 17775, '2023-10-04 20:54:09', '2023-10-04 20:54:09'),
(98, 1135229, 'I Am Rage', 'An ancient cult embroiled in a sinister blood trade makes the deadly mistake of abducting a young woman with a violent, shocking past.', '/iclmQs4O5dy7EAkbykI1qkowfK2.jpg', '/2zzaJ9jzyK1Am8XoS0dFjmP8V0L.jpg', NULL, '2023-08-01', 6.70, 19, '2023-10-04 20:54:10', '2023-10-04 20:54:10'),
(99, 675445, 'PAW Patrol: The Movie', 'Ryder and the pups are called to Adventure City to stop Mayor Humdinger from turning the bustling metropolis into a state of chaos.', '/ic0intvXZSfBlYPIvWXpU1ivUCO.jpg', '/a17F3zXnmuwqxfiDa46mtlosjrv.jpg', NULL, '2021-08-20', 7.40, 1145, '2023-10-04 20:54:11', '2023-10-04 20:54:11'),
(100, 926393, 'The Equalizer 3', 'Robert McCall finds himself at home in Southern Italy but he discovers his friends are under the control of local crime bosses. As events turn deadly, McCall knows what he has to do: become his friends\' protector by taking on the mafia.', '/b0Ej6fnXAP8fK75hlyi2jKqdhHz.jpg', '/lNxR7SmtFxFUfA7n9qtzuaIYvoM.jpg', 'now_playing', '2023-09-01', 7.00, 326, '2023-10-04 20:54:14', '2023-10-04 20:54:14'),
(101, 945729, 'A Haunting in Venice', 'Celebrated sleuth Hercule Poirot, now retired and living in self-imposed exile in Venice, reluctantly attends a Halloween séance at a decaying, haunted palazzo. When one of the guests is murdered, the detective is thrust into a sinister world of shadows and secrets.', '/1Xgjl22MkAZQUavvOeBqRehrvqO.jpg', '/kHlX3oqdD4VGaLpB8O78M25KfdS.jpg', 'now_playing', '2023-09-15', 6.80, 547, '2023-10-04 20:54:21', '2023-10-04 20:54:21'),
(102, 937249, '57 Seconds', 'When a tech blogger lands an interview with a tech guru and stops an attack on him, he finds a mysterious ring that takes him back 57 seconds into the past.', '/dfS5qHWFuXyZQnwYREwb7N4qU5p.jpg', '/jP3FatCTHc460ZGW57q9ypTdBqu.jpg', 'now_playing', '2023-09-29', 6.10, 17, '2023-10-04 20:54:22', '2023-10-04 20:54:22'),
(103, 856289, 'Creation of the Gods I: Kingdom of Storms', 'Based on the most well-known classical fantasy novel of China, Fengshenyanyi, the trilogy is a magnificent eastern high fantasy epic that recreates the prolonged mythical wars between humans, immortals and monsters, which happened more than three thousand years ago.', '/ccJpK0rqzhQeP7Mrs2uKqObFY4L.jpg', '/A8paSZwFPs5EmMGE2hbNGKqBfC5.jpg', 'now_playing', '2023-09-20', 7.40, 96, '2023-10-04 20:54:23', '2023-10-04 20:54:23'),
(104, 1059811, 'Flora and Son', 'Single mum Flora is at a loss about what to do with her rebellious teenage son, Max. Her efforts to keep him out of trouble lead to a beat-up acoustic guitar, a washed-up LA musician, and harmony for this frayed Dublin family.', '/pq2p8ovf8PZps2HafvJaLrZK8gS.jpg', '/nV4nOG6ZCK8orRL7T5wXXgMdM0N.jpg', 'now_playing', '2023-09-22', 7.00, 31, '2023-10-04 20:54:24', '2023-10-04 20:54:24'),
(105, 991708, 'El Conde', 'After living for over two centuries, Augusto Pinochet is a vampire ready to die… but the vultures around him won\'t let him go without one last bite.', '/rxBe0Js4dCvp1ZGgHHnBxjtbGPw.jpg', '/n47trh6SChgncx2GUmwsvry6DLb.jpg', 'now_playing', '2023-09-08', 6.50, 89, '2023-10-04 20:54:24', '2023-10-04 20:54:24'),
(106, 8587, 'The Lion King', 'A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?', '/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg', '/yDaMQbBfyGzGWKxUsPMxzWVuJlY.jpg', 'now_playing', '1994-06-24', 8.30, 17012, '2023-10-04 20:54:25', '2023-10-04 20:54:25'),
(107, 729120, 'Cassandro', 'The true story of Saúl Armendáriz, a gay amateur wrestler from El Paso that rises to international stardom after he creates the character Cassandro, the “Liberace of Lucha Libre.” In the process, he upends not just the macho wrestling world but also his own life.', '/hWHwWsKVr5GkmOI1hWgHZBYkRwi.jpg', '/w8OpyJ7O3Uozflzxkn0J0TmowZn.jpg', 'now_playing', '2023-09-15', 6.60, 55, '2023-10-04 20:54:26', '2023-10-04 20:54:26'),
(108, 1058696, 'Rotting in the Sun', 'A filmmaker facing an existential crisis goes on a vacation to a Mexican gay nudist beach, where he meets a social media celebrity who convinces him to collaborate with him on his new TV show.', '/w4donA0m2rd9OM12uFd0PuHX5fz.jpg', '/hwSvVUjoTSwyt7HI4NBDSdJ7tr0.jpg', 'now_playing', '2023-09-08', 7.10, 24, '2023-10-04 20:54:27', '2023-10-04 20:54:27'),
(109, 872906, 'Jawan', 'An emotional journey of a man who is set to rectify the wrongs in society, in an attempt to get even with his past, driven by a personal vendetta while keeping up to a promise made years ago.', '/w4mPBAfZS5yIXOcqEiEOL8fnuQG.jpg', '/28er4p7B5zMSxUDQKPF1hBsgnys.jpg', 'now_playing', '2023-09-07', 7.40, 68, '2023-10-04 20:54:28', '2023-10-04 20:54:28'),
(110, 853332, 'Rebel', 'Kamal resolves to change his life for the better, and so leaves Belgium to help victims of the war in Syria. But when he arrives, he is forced to join a militia and is left stranded in Raqqa. Back home, his younger brother Nassim quickly becomes easy prey for radical recruiters, who promise to reunite him with his brother. Their mother, Leila, fights to protect the only thing she has left: her youngest son.', '/qw406kzethmStXYG4s9kCyojFaQ.jpg', '/68fnREIWiYQdzcgx9FsLBqLVxee.jpg', 'now_playing', '2023-09-15', 8.30, 26, '2023-10-04 20:54:29', '2023-10-04 20:54:29');
INSERT INTO `movies` (`id`, `e_id`, `title`, `description`, `poster`, `banner`, `type`, `release_date`, `vote`, `vote_count`, `created_at`, `updated_at`) VALUES
(111, 1109534, 'The Dive', 'Two sisters go diving at a beautiful, remote location. One of the sisters is struck by a rock, leaving her trapped 28 meters below. With dangerously low levels of oxygen and cold temperatures, it is up to her sister to fight for her life.', '/o43eMkNkWBBsyxEyyUeQwl4AOe.jpg', '/gknIloEJve4FgAzlKdOUZu1K9HT.jpg', 'now_playing', '2023-08-25', 6.30, 39, '2023-10-04 20:54:30', '2023-10-04 20:54:30'),
(112, 391713, 'Lady Bird', 'Lady Bird McPherson, a strong willed, deeply opinionated, artistic 17 year old comes of age in Sacramento. Her relationship with her mother and her upbringing are questioned and tested as she plans to head off to college.', '/iySFtKLrWvVzXzlFj7x1zalxi5G.jpg', '/pcWxKfFNCznTKYy0E8M9nG1cwL4.jpg', 'now_playing', '2017-11-03', 7.30, 7865, '2023-10-04 20:54:30', '2023-10-04 20:54:30'),
(113, 500104, 'Aristotle and Dante Discover the Secrets of the Universe', 'Two teenage Mexican-American loners in 1987 El Paso explore a new, unusual friendship and the difficult road to self-discovery.', '/3oILDgGBzdQepcKICKMXh4XLnXh.jpg', '/4TAKTbN3viFUERDGAvEF1iuSHVD.jpg', 'now_playing', '2023-09-08', 7.00, 3, '2023-10-04 20:54:32', '2023-10-04 20:54:32'),
(114, 856156, 'The Re-Education of Molly Singer', 'In college, attorney Molly Singer was the life of every party. Now, she\'s about to be fired because she can\'t leave her partying ways behind. Molly\'s boss, Brenda, tells Molly there\'s one way to save her job: re-enroll at her old alma mater, befriend Brenda\'s socially awkward son, Elliot, and take him from zero to campus hero.', '/zCF5HpbSjMELIYiV9aZKY9ka4Jq.jpg', '/tFUolWDR3XzfBpXyuhizTImqDeK.jpg', 'now_playing', '2023-09-29', 0.00, 0, '2023-10-04 20:54:32', '2023-10-04 20:54:32'),
(115, 792293, 'Dumb Money', 'Vlogger Keith Gill sinks his life savings into GameStop stock and posts about it. When social media starts blowing up, so do his life and the lives of everyone following him. As a stock tip becomes a movement, everyone gets rich—until the billionaires fight back, and both sides find their worlds turned upside down.', '/gbOnTa2eTbCAznHiusxHI5oA78c.jpg', '/hb0BeFvZNx2zLGWwuwENOIVeK1U.jpg', 'now_playing', '2023-09-15', 7.30, 13, '2023-10-04 20:54:33', '2023-10-04 20:54:33'),
(116, 1121612, 'No More Bets', 'A depressed programmer and a model decide to seek gold as a seemingly good job opportunity, but they inadvertently become involved in a well-planned Internet scam.', '/gjyqQD5LsNOiVIXuczw9joqjiKQ.jpg', '/1C61KrQDmQ1vMxBllNE1b6Xpan7.jpg', 'now_playing', '2023-08-25', 7.50, 13, '2023-10-04 20:54:34', '2023-10-04 20:54:34'),
(117, 963765, 'Strange Way of Life', 'After twenty-five years, Silva rides a horse across the desert to visit his friend, sheriff Jake. They celebrate the meeting, but the next morning, Jake tells him that reason for his trip is not to go down the memory lane of their friendship.', '/1hLsR3aYCXnyRopd7JZHXI1p9Jm.jpg', '/8J5GetxLHw6R380GUBEmH95dvrl.jpg', 'now_playing', '2023-10-04', 6.40, 74, '2023-10-04 20:54:35', '2023-10-04 20:54:35'),
(118, 1181568, 'The Exorcists', 'When his child is possessed by an unrelenting evil, a father hires three expert exorcists to purge the demon and save his family. But this demon is merely the gatekeeper to a true hellion that will be unleashed on earth if the trio of exorcists fail.', '/zddK1YMeZrVKAEd33YdDUrTzZ4L.jpg', '/mKABkaVXweZXWUrGfhvONnm5m1m.jpg', 'now_playing', '2023-09-29', 3.00, 1, '2023-10-04 20:54:36', '2023-10-04 20:54:36'),
(119, 1032194, 'The Blind', 'In the 1960s Deep South, Phil Robertson seeks to conquer the shame of his past, addiction, and complicated family dynamics, ultimately finding redemption in an unlikely place.', '/lkWIScXflR9sG7XPlH9TWuU7XMj.jpg', '/oGZei32e4tKb6rhDTpDr2ZwAOur.jpg', 'now_playing', '2023-09-28', 10.00, 3, '2023-10-04 20:54:37', '2023-10-04 20:54:37'),
(120, 899524, 'Golda', 'Set during the tense 19 days of the Yom Kippur War in 1973, Israeli Prime Minister Golda Meir is faced with the potential of Israel’s complete destruction. She must navigate overwhelming odds, a skeptical cabinet and a complex relationship with US Secretary of State Henry Kissinger, with millions of lives in the balance. Her tough leadership and compassion would ultimately decide the fate of her nation and leave her with a controversial legacy around the world.', '/4SbxFDkhxZeAAN1zxgVJpdUB3V.jpg', '/d1A5OQ4PRYssLilGCTRxqwKSQ8q.jpg', 'now_playing', '2023-08-23', 6.80, 34, '2023-10-04 20:54:38', '2023-10-04 20:54:38'),
(121, 1097150, 'Deliver Us', 'When a nun in a remote convent claims immaculate conception, the Vatican sends a team of priests to investigate, concerned about an ancient prophecy that a woman will give birth to twin boys: one the Messiah, the other the Anti-Christ.', '/uoKUTwvHvSVHWjSM4RhCh6rKL0U.jpg', '/pZFuow2rweIqyNHz6xZSxnLVmMc.jpg', 'now_playing', '2023-09-29', 5.80, 4, '2023-10-04 20:54:39', '2023-10-04 20:54:39'),
(122, 744857, 'When Evil Lurks', 'Residents of a small rural town discover that a demon is about to be born among them. They desperately try to escape before the evil is born, but it may be too late.', '/iQ7G9LhP7NRRIUM4Vlai3eOxBAc.jpg', '/mv8M0PqQYicndU7TGgBAHrI4uUo.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:40', '2023-10-04 20:54:40'),
(123, 1089765, 'Barber', 'Val Barber, a private investigator, is hired by a wealthy widow to find her missing granddaughter. Set in Dublin against the background of a global pandemic, Barber’s initial investigation into Sara’s disappearance quickly darkens. Secrets start surfacing in unexpected ways. Before too long, Barber finds himself entangled with powerful men of shady morals determined to thwart his investigation.  Has he bitten off more than he can chew?', '/lO3hGCsGF9SMkgxja1OX1BZh4Qq.jpg', '/6OmzzuGWAa7YgvkbxP6XnvF5VAx.jpg', 'now_playing', '2023-09-22', 5.00, 1, '2023-10-04 20:54:41', '2023-10-04 20:54:41'),
(124, 910571, 'Fair Play', 'An unexpected promotion at a cutthroat hedge fund pushes a young couple\'s relationship to the brink, threatening to unravel not only their recent engagement but their lives.', '/tGgojtD6vJKYeCfktAhhA1pmH0n.jpg', '/50Wq7fY21obXVRICuljdlSigWvH.jpg', 'now_playing', '2023-09-29', 0.00, 0, '2023-10-04 20:54:42', '2023-10-04 20:54:42'),
(125, 567610, 'American Outlaws', 'Facing the possibility of prison - and in search of an idealized freedom - 3 siblings take matters in to their own hands with a cross country crime spree of epic proportions.', '/9E8QM7zsuKWEvKT4WMf13zYCxFV.jpg', '/A8gwQ3YpAvXPT0MKLePkCT4AR7I.jpg', 'now_playing', '2023-09-15', 5.50, 4, '2023-10-04 20:54:43', '2023-10-04 20:54:43'),
(126, 1024127, 'King of Killers', 'Garan is a part of a group of international hitmen who are contracted to take out the most dangerous killer in the world, only to find out that they\'re the ones being hunted.', '/x5AreOAgkTBzUSL58o4jsYortw2.jpg', '/cOF7XiobQU4TC2tKDPXJ8d2nULP.jpg', 'now_playing', '2023-09-01', 5.20, 22, '2023-10-04 20:54:44', '2023-10-04 20:54:44'),
(127, 944952, 'The Royal Hotel', 'After running out of money while backpacking in a tiny, male-dominated town in the Australian outback, two friends resort to a working holiday at the Royal Hotel. When the locals behavior starts crossing the line, the girls find themselves trapped in an unnerving situation that grows rapidly out of their control.', '/oJwb2PV1LGxDp6Q3lynrjADxOIv.jpg', '/cofs7Y72FkRjALbOOOz8q7Uty6h.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:45', '2023-10-04 20:54:45'),
(128, 1811, 'Nowhere', 'In Los Angeles, a colorful assortment of bohemians try to make sense of their intersecting lives. The moody Dark Smith, his bisexual girlfriend, her lesbian lover and their shy gay friend plan on attending the wildest party of the year. But they\'ll only make it if they can survive the drug trips, suicides, trysts, mutilations and alien abductions that occur as one surreal day unfolds.', '/9CaVnvBRbzsM7mcJoIMncpHSBBN.jpg', '/4qoh74EQvi6vOXMecNX5s85FDch.jpg', 'now_playing', '2023-09-27', 6.70, 136, '2023-10-04 20:54:46', '2023-10-04 20:54:46'),
(129, 760245, 'Foe', 'Hen & Junior farm a secluded piece of land that has been in Junior\'s family for generations, but their quiet life is thrown into turmoil when an uninvited stranger shows up at their door with a startling proposal.', '/eTPBizhkX6B9NgzPzkhVIOvwXxZ.jpg', '/tFxAeagQbrjCqjikwvfsLf6ktT7.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:47', '2023-10-04 20:54:47'),
(130, 1168521, 'Dark Asset', 'A charming guy attempts to pick up a woman in a bar by spinning a tale involving spies, implanted microchips and the dangerous military scientist hunting him.', '/hfxqsC8Bz2wMZmXKwEZqKyJiScT.jpg', '/dcqfqpAFBDP5K7rhNgUY6YVEVh3.jpg', 'now_playing', '2023-09-22', 5.30, 6, '2023-10-04 20:54:48', '2023-10-04 20:54:48'),
(131, 1024773, 'It Lives Inside', 'An Indian-American teenager struggling with her cultural identity has a falling out with her former best friend and, in the process, unwittingly releases a demonic entity that grows stronger by feeding on her loneliness.', '/meMZCf4SyH7p3F6c46wNn91enSn.jpg', '/hLfj6MSJWbd39bomf8DU0gWQ9b8.jpg', 'now_playing', '2023-09-22', 5.20, 11, '2023-10-04 20:54:49', '2023-10-04 20:54:49'),
(132, 763165, 'The Burial', 'A lawyer helps a funeral home owner save his family business from a corporate behemoth. In a move to bring resonance to a dry case, the lawyer digs up a complex web of race, power, and oppression that forces everyone to examine prejudices.', '/s6cr2W45CkFZLttXAeH8iiZwZLk.jpg', '/tP8iMEFzKTTXf9IylKwczhd8jza.jpg', 'now_playing', '2023-10-06', 8.00, 1, '2023-10-04 20:54:49', '2023-10-04 20:54:49'),
(133, 1163825, 'Ghosts of the Chelsea Hotel', 'A new documentary, exploring the Chelsea Hotel\'s role in the cultural and artistic movements of the 20th century, from the Beat Generation to the Punk Rock scene. Delving into the history of the hotel, as a home and gathering place for some of the most influential artists and cultural icons of the past century, including Mark Twain, Arthur Miller, Jack Kerouac, William S. Burroughs, Bob Dylan, Iggy Pop, Leonard Cohen, Madonna and a possible spirit or two. Including historical footage of some of the residents and regulars who made the glorious Chelsea Hotel so legendary.', NULL, NULL, 'now_playing', '2023-10-04', 0.00, 0, '2023-10-04 20:54:50', '2023-10-04 20:54:50'),
(134, 1057835, 'Marisol', 'For Marisol Rivera, a first generation Mexican-American, college is everything she\'s worked toward. She spent mornings cleaning horse stalls and evenings studying. Now, with a scholarship in hand, she\'s ready to leave Southwest Texas and begin her new life. However, when Marisol is falsely accused of a crime, she learns a heartbreaking truth: she\'s undocumented. Forced to go on the run, Marisol discovers a kind America amidst a harsh bureaucratic system. A coming of age film through the lens of immigration, Marisol critically examines systemic oppression and the causality of racism.', '/tpuCJ55wPYVo0XeRk7E4Wu0uTjJ.jpg', '/mVEJAPRhLhjN724z6Xqx8PUw0NX.jpg', 'now_playing', '2023-09-01', 0.00, 0, '2023-10-04 20:54:51', '2023-10-04 20:54:51'),
(135, 1182002, 'Fintech', 'A workplace comedy about two tech bros running their company into the ground.', '/po0keBfkanr14iEIYpkbNyaJLQG.jpg', NULL, 'now_playing', '2023-10-03', 0.00, 0, '2023-10-04 20:54:52', '2023-10-04 20:54:52'),
(136, 965489, 'Kushi', 'Raised in an atheist household, a young man falls in love with the daughter of his father\'s arch-rival, a devout Hindu leader.', '/t62pmGjImf4rg4VXsbIImKJgVan.jpg', '/iPTB7IFqxC1qG1rU5hQDxbzLQAr.jpg', 'now_playing', '2023-09-01', 6.40, 4, '2023-10-04 20:54:53', '2023-10-04 20:54:53'),
(137, 843394, 'Cat Person', 'When Margot, a college sophomore, goes on a date with the older Robert, she finds that IRL Robert doesn’t live up to the Robert she has been flirting with over texts.', '/1oGZImUekj1hq9Bo14byLullv2W.jpg', '/el2b1ic9zg1z97NjuU5lWZE2KXC.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:53', '2023-10-04 20:54:53'),
(138, 983507, 'Good Boy', 'Christian - a millionaire heir, meets Sigrid - a young student, on a dating app. They hit it off quickly, but there\'s only one problem: Christian lives with Frank, a man who dresses up and constantly acts like a dog.', '/9DPG1gxLwV2oyFdHq3SnISsWbse.jpg', '/AucuqDaUW4z1oT5XyL71qwRY2F6.jpg', 'now_playing', '2023-09-08', 7.90, 38, '2023-10-04 20:54:54', '2023-10-04 20:54:54'),
(139, 980816, 'Miranda\'s Victim', 'The true story of Trish Weir who in 1963 was kidnapped and brutally raped by Ernesto Miranda. Committed to putting her assailant in prison, Trish’s life is destroyed by America’s legal system as she triggers a law that transforms the nation.', '/t5xIa8GSYX7Y6BEkDWSJ8uSaDBL.jpg', '/nqLlfez5zw3QR2bHu8zL9id30La.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:55', '2023-10-04 20:54:55'),
(140, 503417, 'She Came to Me', 'Composer Steven Lauddem is plagued by a creative block which leaves him unable to finish the score for his big comeback opera. When his former therapist-turned-wife Patricia suggests he rekindle his creativity by getting lost in the city, Steven sets out in search of inspiration. His epiphany comes after he meets a spirited woman named Katrina and discovers his life has much more potential than he bargained for, or ever could have imagined.', '/2lG18RqCK8qTk7R5jA1L7ZRMWXu.jpg', '/1bxLr2F5IyfBhGtxe5hzIOO43Hz.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:54:56', '2023-10-04 20:54:56'),
(141, 926599, 'All Fun and Games', 'Two kids play a game with their sadistic older cousin and awaken a cruel entity knows as \"The Skarrow.\"', '/1m0CTxlotr8H8GaoioL2IJHL1gW.jpg', '/pGVvtVPz7Hwe9MTAtMdLMHnjFGi.jpg', 'now_playing', '2023-09-01', 5.60, 13, '2023-10-04 20:54:57', '2023-10-04 20:54:57'),
(142, 1058691, 'PLAN C', 'A hidden grassroots organization doggedly fights to expand access to abortion pills across the United States keeping hope alive during a global pandemic and the fall of Roe v. Wade.', '/4Yfm6gFrXHR6t1DIoxjbJGPtVXq.jpg', '/axuHnm3Yeio6B2AG0dgPzMFH6XM.jpg', 'now_playing', '2023-10-05', 0.00, 0, '2023-10-04 20:54:58', '2023-10-04 20:54:58'),
(143, 996347, 'The Good Mother', 'A journalist and his pregnant girlfriend attempt to track down those responsible for the murder of his estranged son. Together, they confront a world of drugs and corruption in the underbelly of their small city in upstate New York, where they uncover an even darker secret.', '/L71mjGG7lGIhWZpyBKNxniWQ9.jpg', '/wuSbgcdhkD4wyVb02uCnnBsy7cl.jpg', 'now_playing', '2023-09-01', 4.60, 16, '2023-10-04 20:54:59', '2023-10-04 20:54:59'),
(144, 986674, 'Shelter in Solitude', 'A death row prisoner with 10 days left to live forms an unlikely bond with a washed up country singer turned prison guard.', '/o7rohwFWyIgRKXCOesM0UFW47ZM.jpg', NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:00', '2023-10-04 20:55:00'),
(145, 1009654, '1521: The Quest for Love and Freedom', 'In pre-Spanish era Philippines, a young native princess with goddess-like beauty falls in love with a dashing Spanish soldier. Against all odds, and pulled apart by their loyalties to their own people, they fight for their clandestine romance.', '/AjzPIYe8tRLmCvGpKr2R9xGuhAi.jpg', NULL, 'now_playing', '2023-10-02', 0.00, 0, '2023-10-04 20:55:01', '2023-10-04 20:55:01'),
(147, 1147301, 'Mercy Road', 'A flawed everyman commits an impulsive and vicious crime. In this ultimate journey to redemption, he soon learns just how far he is willing to go to save his child.', '/1Bls59tl2W03BpVgTNATiH5HA2H.jpg', '/p3tcUYRyaqJlkXd37jsL2pkPdyO.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:02', '2023-10-04 20:55:02'),
(148, 1181277, 'Circle City Supernatural', 'The calls to Lindsay Mallyn\'s late-night, paranormal radio show are going from strange to stranger as the people of Circle City confront the supernatural in this Halloween-themed anthology.', '/6GRoVsRjVxL8bZs177PcOvdx86g.jpg', '/yom04LmuExgZq6TG4svzFx1rbRW.jpg', 'now_playing', '2023-10-01', 0.00, 0, '2023-10-04 20:55:03', '2023-10-04 20:55:03'),
(149, 752354, 'Monsters of California', 'Teenager Dallas Edwards and his derelict friends go on a quest for the meaning behind a series of mysterious, paranormal events in Southern California.  The truths they uncover begin to unravel extraordinary secrets.', '/dzENf6zouG4xrNaXf4KcZNmP6bK.jpg', '/d5UKaYuGjwUUTxWlbe5JOozXvvZ.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:04', '2023-10-04 20:55:04'),
(150, 1075815, 'Joan Baez: I Am a Noise', 'Since her debut at the age of 18, musician, civil rights campaigner and activist Joan Baez has been on stage for over 60 years. For the now 82-year-old, the personal has always been political, and her friendship with Martin Luther King and her pacifism have shaped her commitment. In this biography that opens with her farewell tour, Baez takes stock in an unsparing fashion and confronts sometimes painful memories.', '/cyw80IbEArXhb2PQTgDkceSaMTS.jpg', '/tZJUsLS7fcYb0i2OKH55ur05eNE.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:05', '2023-10-04 20:55:05'),
(151, 1175873, 'Vindicta', 'When a city is terrorized by a sadistic serial killer, a seasoned detective and a newly recruited paramedic discover the key to stopping the bloodshed lies in unlocking the truth of their own haunted pasts.', '/opQdzqwcJRtIuZEWDEU4orBOI8P.jpg', NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:06', '2023-10-04 20:55:06'),
(152, 1126608, 'Raid On The Lethal Zone', 'In the 1990s, an armed police team in the south-western border of China encounter floods and drug traffickers while on a mission, resulting in heavy casualties. In order to avenge their dead comrades, the survivors launched a final confrontation against the drug dealers.', '/1VSuB0kB5wtLfs9wLpUieRa6vvK.jpg', '/9uFAyoe3hCdX7uo944ZzpvcVBHG.jpg', 'now_playing', '2023-09-08', 6.60, 5, '2023-10-04 20:55:07', '2023-10-04 20:55:07'),
(153, 937220, 'Bank of Dave', 'The true story of how Dave Fishwick, a working class man and self-made millionaire, fought to set up a community bank so that he could help the local businesses of Burnley not only survive, but thrive. In his bid to help his beloved community, he has to take on the elitist financial institutions of London and fight to receive the first, new banking license to be issued in over 100 years.', '/6qRsmh6500c6piPbIcwc2VZ3E1n.jpg', '/wcka0WH6otb1xueWk62Rpxqh3nm.jpg', 'now_playing', '2023-08-25', 7.00, 24, '2023-10-04 20:55:07', '2023-10-04 20:55:07'),
(154, 1040892, 'Slotherhouse', 'Wanting to have a killer year, sorority sister Emily Young realizes she might just be the best option for her sorority. While beginning her campaign, she finds an adorable sloth that steals her heart and soon realizes she just might steal the hearts, and votes, of her sorority sisters. But when bodies slowly begin to pile up in the Sigma Lambda Theta house, Emily and her sorority sisters realize the deaths are being caused by their new house mascot, the cuddly sloth Alpha. Will Emily and her sisters escape the house with their lives? Or is this death-sloth with three razor sharp claws too quick for them?', '/pLSoVBuBa3aqFBgBY2puu3BN8of.jpg', '/rhuqWhQ2gmy8toUiDtpuHCdUt5j.jpg', 'now_playing', '2023-08-30', 4.60, 14, '2023-10-04 20:55:08', '2023-10-04 20:55:08'),
(155, 952813, 'The Legend of Johnny Jones', 'Born in the New Jersey public housing, the young Johnny Jones (Robert Crayton) in his life has known only abuse and poverty. Pushed over the edge, Johnny Jones suffers a mental breakdown and ignites a killing spree never seen in history, leaving a trail of death and carnage everywhere he goes. While the tensions and the murders only get worse, the city calls Detective Cutchin (Tom Sizemore) to solve the case and bring Johnny Jones to justice.', '/asoj65nwA5asHKxcyjeeAGZXOwR.jpg', '/cKxscfbUSsN1crM59yTeKfsWcxx.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:09', '2023-10-04 20:55:09'),
(156, 1046620, 'The Vaccine War', 'Faced with the catastrophic challenge of fighting a global crisis like no other, Indian scientists take on the mantle of producing vaccine despite not having enough resources and infrastructure to save the nation\'s sixteen million citizens.', '/ceWCWvbEogkXU1It8gH1l2rcfEJ.jpg', '/5mHHvukFGmmRtEmqrlUDl1Y4Gny.jpg', 'now_playing', '2023-09-28', 7.50, 2, '2023-10-04 20:55:10', '2023-10-04 20:55:10'),
(157, 24128, 'Stop Making Sense', 'A concert film documenting Talking Heads at the height of their popularity, on tour for their 1983 album \"Speaking in Tongues.\" The band takes the stage one by one and is joined by a cadre of guest musicians for a career-spanning and cinematic performance that features creative choreography and visuals.', '/uFMsMsk1NGo0QWs9IHknZVHSe4O.jpg', '/iLxliFy7HrIbKGHTdwVfgKeQLwG.jpg', 'now_playing', '1984-11-16', 8.20, 212, '2023-10-04 20:55:11', '2023-10-04 20:55:11'),
(158, 1137347, 'Untitled Focus Features Film', 'Plot TBA. Set to be released in theaters on October 6, 2023 by Focus Features.', NULL, NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:12', '2023-10-04 20:55:12'),
(159, 958006, 'The Kill Room', 'A hitman, his boss, an art dealer and a money-laundering scheme that accidentally turns the assassin into an overnight avant-garde sensation, one that forces her to play the art world against the underworld.', '/ciEZWh4fkq394ToQBr91UDUK45O.jpg', '/aRYhlWtxJoW8URLJJsPtn5788ge.jpg', 'now_playing', '2023-09-28', 7.00, 2, '2023-10-04 20:55:13', '2023-10-04 20:55:13'),
(160, 1105324, 'A Very Good Girl', 'After a heartless firing triggers a chain of unfortunate events, Philo plots a meticulous revenge against retail mogul, Mother Molly, aiming to dismantle her empire and seize the ultimate payback. This time, there is no mercy.', '/ezfxB7Kd2l6keH9xBCX4599zuuL.jpg', '/q3kUCQnUIgOqbsl5RyAwuFY95A5.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:14', '2023-10-04 20:55:14'),
(161, 988452, 'Surprised by Oxford', 'A woman struggles with her views on religion, complicated by her attraction to a devout believer.', '/bE8wDiRzOHvfqMCJ74oGVYX9fYI.jpg', '/qo5ZY4CCGGcJxnBzzx4YHU46gKN.jpg', 'now_playing', '2023-09-27', 0.00, 0, '2023-10-04 20:55:15', '2023-10-04 20:55:15'),
(162, 1180294, 'Flying High Again', 'In a world, where the snowboard corporatocracy cares more about the next Instagram swipe, one company has decided to team up with legendary snowboard film director, Mike Hatchett, and do the impossible. This film defies all odds - to bring together a crew of passionate riders for a full-length feature film - and celebrate what matters most: a bomber squad, rowdy soundtrack, and pure unadulterated riding action. Are you ready?', '/8LNvO42fQdDekjaJdDuGfpv47iE.jpg', NULL, 'now_playing', '2023-10-01', 0.00, 0, '2023-10-04 20:55:16', '2023-10-04 20:55:16'),
(163, 1058689, 'My Animal', 'Tormented by a hidden family curse, Heather lives in seclusion on the outskirts of a small town. When she falls for the rebellious Jonny, their connection threatens to unravel Heather\'s suppressed desires, tempting her to unleash the animal within.', '/8fwsmvBMVQe1iF608ZpdH4CTx69.jpg', '/cAUfKOD49fzODK4EXalEA1ANg0P.jpg', 'now_playing', '2023-09-08', 4.90, 9, '2023-10-04 20:55:16', '2023-10-04 20:55:16'),
(164, 1025067, 'Dream Girl 2', 'Karam, a small-town boy from Mathura, is struggling every day to pay his father\'s debt, who has borrowed money from nearly everyone on the planet. On the other hand, he is deeply in love with Pari, whose father has kept the conditions to marry her. To make ends meet, Karam dons as Pooja, which creates wild chaos and a comedy of errors.', '/spiHFvHk7vqsIF4wAU7S6wcTzek.jpg', '/uHvxzUCjRQHSRBdmyoLQY6ZrtJO.jpg', 'now_playing', '2023-08-25', 6.00, 1, '2023-10-04 20:55:17', '2023-10-04 20:55:17'),
(165, 833205, 'Americanish', 'In Jackson Heights, career-driven sisters Maryam and Sam and their newly-immigrated cousin Ameera must navigate the consistent — and sometimes conflicting — demands of romance, culture, work and family.', '/2eOlUw35Z2kXw5420Axnquhcy5K.jpg', '/1qHBAE9PfHvdmnpfDYAkb1oOfzc.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:18', '2023-10-04 20:55:18'),
(166, 1184053, 'From This Small Place', 'A six-year-old Rohingya boy named Hossain fills his days with grand adventure while growing up in the world’s biggest refugee camp. But soon, the crisis around him grows increasingly dangerous and he must grapple with the complexities of an unfair world for the first time in his young life.', NULL, NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:19', '2023-10-04 20:55:19'),
(167, 1145028, 'Woman in the Maze', 'A young woman rents a cursed house, forcing her to solve the mystery to find a way out.', '/wfELkgIAMTP132Z1AY4rnzAwW0K.jpg', '/4qSpYr5tscYsP9zgUhngSXsBEBL.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:20', '2023-10-04 20:55:20'),
(168, 979287, 'Nandor Fodor and the Talking Mongoose', 'In 1935, Hungarian-American para-psychologist Nandor Fodor began his investigation of a strange occurrence on the Isle of Man. An average British family, the Irvings, claimed to have been contacted by a mysterious entity at their farm. A talking mongoose. Named Gef (Pronounced \"Jeff\".)', '/pnvmMHuMrdWkSC3Y1PtIxOXILNQ.jpg', '/bCBxtsw9ijVY0ETAtAyOANK3sKi.jpg', 'now_playing', '2023-09-01', 6.10, 11, '2023-10-04 20:55:21', '2023-10-04 20:55:21'),
(169, 1027800, 'She Stays', 'After a night of partying in downtown Tijuana, Laura sacrifices her ex-boyfriend in order to join a coven of vampire dancers.', '/wHRmj4NXdBbduSfg8GHmk8fSXtn.jpg', '/86OzqBV7mRhp5btt2ryNAMXrkBt.jpg', 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:21', '2023-10-04 20:55:21'),
(170, 676727, 'The Inventor', 'The insatiably curious and headstrong inventor Leonardo da Vinci leaves Italy to join the French court, where he can experiment freely, inventing flying contraptions, incredible machines, and study the human body. There, joined in his adventure by the audacious princess Marguerite, Leonardo will uncover the answer to the ultimate question – \"What is the meaning of it all?\"', '/2OZMoQ2qr0G9SehiOzJxKn3kud9.jpg', '/oBNW28Zn0clre1GA550q2aRarKx.jpg', 'now_playing', '2023-09-15', 6.00, 1, '2023-10-04 20:55:22', '2023-10-04 20:55:22'),
(171, 1179147, 'Welcome Space Brothers', 'WELCOME SPACE BROTHERS unveils the true story of The Unarius Academy of Science, a long-running extraterrestrial-channeling spiritual school in El Cajon, California that in the late 1970s became a wildly prolific filmmaking and art collective under the direction of outlandish spiritual leader and visionary filmmaker Ruth E. Norman, AKA “Archangel Uriel.”', NULL, NULL, 'now_playing', '2023-10-08', 0.00, 0, '2023-10-04 20:55:23', '2023-10-04 20:55:23'),
(172, 1155384, 'Can I Buy Your Love from a Vending Machine?', 'Salaryman Ayumu Koiwai just can\'t tear his eyes away from the strong, muscular man as he checks on the stocks of the vending machine in his office. He may be a proper adult now, but everything about the emotions Yamashita awakens in him feels like a teenager\'s first love...', '/dr4pcT67FL0AwNqrbq9u58zlAwT.jpg', NULL, 'now_playing', '2023-10-01', 0.00, 0, '2023-10-04 20:55:24', '2023-10-04 20:55:24'),
(173, 1184034, 'Bloom', 'A Midwestern woman in her late-sixties takes off on a road trip across America, wandering through memories and reckoning with her past.', '/nL004UZB3MHKqxbiVD0UIqHutAp.jpg', '/qygUQaVvsYBftRjQ5efiQICmV4B.jpg', 'now_playing', '2023-10-07', 0.00, 0, '2023-10-04 20:55:25', '2023-10-04 20:55:25'),
(174, 935906, 'Scrapper', 'Living alone since her beloved mum died, 12-year-old Georgie fills the flat they shared with her own special magic. But when her absent father Jason turns up out of the blue, she’s forced to confront reality.', '/fezRPcjrd4whodnVVcFRCgDpK11.jpg', '/hkjOiIKeZ59XupKXVHGaLtHG1u.jpg', 'now_playing', '2023-08-25', 6.70, 10, '2023-10-04 20:55:25', '2023-10-04 20:55:25'),
(175, 1174993, 'Audio and Visual Experiment 7', 'The seventh in an ongoing collaboration between video editor Grandt Savages and audio editor Hugo Alexander, made entirely using remixed media.', '/zq5k2HGGKi6vxD8uwkRmTfxrOUX.jpg', NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:26', '2023-10-04 20:55:26'),
(176, 900409, 'On Fire', 'Inspired by true and harrowing events, an ordinary man finds his world suddenly torn apart as devastating wildfires rip through the surrounding countryside. With precious moments ticking by, he must flee with his son and pregnant wife if they have any hope of surviving the rapid forces of mother nature.', '/1ms0zRAMtbVq5XoIfrlcSj84g6G.jpg', '/lh2nbC8qRBJxyH0iqkPmXlNqhcK.jpg', 'now_playing', '2023-09-29', 0.00, 0, '2023-10-04 20:55:27', '2023-10-04 20:55:27'),
(177, 1184443, 'Thunder Rolls! The World of Blind Baseball', 'How can individuals who are blind and visually impaired play baseball? This documentary tells the story of how this is possible. When the rules of a game are changed, appropriate technologies are applied, and opportunities are opened, individuals with disabilities can play competitive sports at Olympic levels. Combines a thriller sports story with an educational message. Dramatic action centers on the quest of the Indy Thunder team to win their second World Championship. The film follows the team members and their coach, Darnell Booker, as they come together as a family. It reveals a nuanced world that involves the full range of accomplishments and engagements of the individuals portrayed. A spirited, humanistic, sports story operating on many levels of entertainment and social significance.', NULL, NULL, 'now_playing', '2023-10-07', 0.00, 0, '2023-10-04 20:55:28', '2023-10-04 20:55:28'),
(178, 1184412, 'Long December', 'Nearing the end of another financially difficult year and feeling pressured to finally give up on his dreams, struggling musician Gabe Lovell wonders if his break is just around the corner when his rock star cousin offers him a spot in the final show of his tour.', NULL, NULL, 'now_playing', '2023-10-06', 0.00, 0, '2023-10-04 20:55:29', '2023-10-04 20:55:29'),
(179, 1184185, 'First Lady of BMF: The Tonesa Welch Story', 'Inspired by the true life of Detroit native Tonesa Welch. It charts Welch\'s rise from a teenager\'s mother to a drug dealer, she is referred to by federal prosecutors as \"The First Lady of the BMF\"', '/qMUwy7XASHTUocr5UN4okEl33DG.jpg', '/lh8ILJFyTfmGqZyxd1NwdjbkfIs.jpg', 'now_playing', '2023-10-05', 10.00, 1, '2023-10-04 20:55:30', '2023-10-04 20:55:30'),
(180, 9479, 'The Nightmare Before Christmas', 'Tired of scaring humans every October 31 with the same old bag of tricks, Jack Skellington, the spindly king of Halloween Town, kidnaps Santa Claus and plans to deliver shrunken heads and other ghoulish gifts to children on Christmas morning. But as Christmas approaches, Jack\'s rag-doll girlfriend, Sally, tries to foil his misguided plans.', '/oQffRNjK8e19rF7xVYEN8ew0j7b.jpg', '/xWT5F1DNxciNLEMXRl49iq8zvN7.jpg', 'upcoming', '2020-10-02', 7.80, 8506, '2023-10-04 20:55:31', '2023-10-04 20:55:31'),
(181, 507089, 'Five Nights at Freddy\'s', 'Recently fired and desperate for work, a troubled young man named Mike agrees to take a position as a night security guard at an abandoned theme restaurant: Freddy Fazbear\'s Pizzeria. But he soon discovers that nothing at Freddy\'s is what it seems.', '/h3hhfWdBhdb2JLMZprQ1IvBe90h.jpg', '/whB2PJfxrDWwwksprliJTjYbcZJ.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:55:32', '2023-10-04 20:55:32'),
(182, 466420, 'Killers of the Flower Moon', 'When oil is discovered in 1920s Oklahoma under Osage Nation land, the Osage people are murdered one by one—until the FBI steps in to unravel the mystery.', '/dB6Krk806zeqd0YNp2ngQ9zXteH.jpg', '/uvsL5Q5Juf8ivqBnlr4nFVUwVoa.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:33', '2023-10-04 20:55:33'),
(183, 897087, 'Freelance', 'An ex special forces operative stuck in a dead-end desk job reluctantly takes on a gig to provide private security for a washed-up journalist as she interviews a ruthless—but impeccably dressed—dictator. When a military coup breaks out just as she\'s about to get the scoop of a lifetime, the unlikely trio must figure out how to survive the jungle, the assassins, and each other in order to make it out alive.', '/7cpAXiwsdFx6GGU0TBGRvDYJuRQ.jpg', '/fFCfl9WegDQoSPlJL3nCNJoSuQM.jpg', 'upcoming', '2023-10-27', 9.00, 1, '2023-10-04 20:55:34', '2023-10-04 20:55:34'),
(184, 1160164, 'TAYLOR SWIFT | THE ERAS TOUR', 'The cultural phenomenon continues on the big screen! Immerse yourself in this once-in-a-lifetime concert film experience with a breathtaking, cinematic view of the history-making tour.', '/a5EreVlyB9fXzZ2Rf9ugOLrW5YI.jpg', '/wCZfWZ09GW9YiHdu1BH6WWI0JKl.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:34', '2023-10-04 20:55:34'),
(185, 915935, 'Anatomy of a Fall', 'Sandra, Samuel and their visually impaired son Daniel have been living in a remote mountain location for the past year. When Samuel is found dead outside the house, an investigation for death in suspicious circumstances is launched. Amidst the uncertainty, Sandra is indicted: was it suicide or homicide? A year later Daniel attends his mother’s trial, a veritable dissection of his parents’ relationship.', '/AlbySG5o87A3gEkeaMhUADeDpvZ.jpg', '/kszooR7v1TLFM4pzx6IkKq2jDAN.jpg', 'upcoming', '2023-10-13', 7.90, 199, '2023-10-04 20:55:35', '2023-10-04 20:55:35'),
(186, 949229, 'LEO', 'A mild-mannered café owner becomes a local hero through an act of violence, which sets off repercussions with connections to an old life he left behind, shaking his newly constructed life to its very core.', '/qT2xJtJ7Jza5gC4RSiEXWrztZHo.jpg', '/vPac9oyoZuCEVIKpADrJzpwurTc.jpg', 'upcoming', '2023-10-19', 0.00, 0, '2023-10-04 20:55:36', '2023-10-04 20:55:36'),
(187, 800158, 'The Killer', 'After a fateful near-miss, an assassin battles his employers, and himself, on an international manhunt he insists isn\'t personal.', '/ipkcgvN7h3yZnbYowthloHLKsf4.jpg', '/47nv1UXkSDvpBlEv3BiAss9TxIX.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:55:37', '2023-10-04 20:55:37'),
(188, 277834, 'Moana', 'In Ancient Polynesia, when a terrible curse incurred by Maui reaches an impetuous Chieftain\'s daughter\'s island, she answers the Ocean\'s call to seek out the demigod to set things right.', '/vNJFiwtsl7Twww7C0uM4qPnygNw.jpg', '/iYLKMV7PIBtFmtygRrhSiyzcVsF.jpg', 'upcoming', '2016-11-23', 7.60, 11517, '2023-10-04 20:55:38', '2023-10-04 20:55:38'),
(189, 987750, 'Inspector Sun and the Curse of the Black Widow', 'A spider detective boards a seaplane to San Francisco after finally capturing his nemesis. However, a murder on the flight draws him into a plot that threatens both the human and bug world.', '/zUYleUhOpEew8wdcusS0eGytZ6T.jpg', '/oMsoN3RsJEjxOWcImvwTffEnkMd.jpg', 'upcoming', '2023-10-27', 6.80, 131, '2023-10-04 20:55:39', '2023-10-04 20:55:39'),
(190, 269509, 'The Canterville Ghost', 'An American family moves in to the Canterville Chase, a London mansion that has been haunted by ghost Sir Simon De Canterville for 300 years.', '/8yd79qiF9rz4IZzGef1F7UkGvcI.jpg', '/91bncV8GdHN2FLh2bHxSoPLQF5y.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:40', '2023-10-04 20:55:40'),
(191, 862968, 'Pain Hustlers', 'After losing her job, a single mom falls into a lucrative but ultimately dangerous scheme selling prescription drugs.', '/a5zQvf4G1p9qVi34zVsrqh45TMO.jpg', '/jHeTYF5y86h0eJM09px6tgJqd0z.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:41', '2023-10-04 20:55:41'),
(192, 843846, 'Butcher\'s Crossing', 'In the 1870s, a young Harvard dropout seeks his destiny out West by tying his fate to a team of buffalo hunters led by a man named Miller. Together, they embark on a harrowing journey risking life and sanity.', '/ipUrHk8sLWqQQ2wqSYbZui27EQN.jpg', '/6gcXySbEdXC9V39chjcJ1ZxOi07.jpg', 'upcoming', '2023-10-20', 5.10, 4, '2023-10-04 20:55:41', '2023-10-04 20:55:41'),
(193, 840430, 'The Holdovers', 'A curmudgeonly instructor at a New England prep school is forced to remain on campus during Christmas break to babysit the handful of students with nowhere to go. Eventually, he forms an unlikely bond with one of them — a damaged, brainy troublemaker — and with the school’s head cook, who has just lost a son in Vietnam.', '/uS8RWKswotSSojHkvsHage05Ifr.jpg', '/57fhbxl9is7W7ur5v6UuvlNsoSg.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:55:42', '2023-10-04 20:55:42'),
(194, 609768, 'Dear David', 'Shortly after comic artist Adam responds to Internet trolls, he begins experiencing sleep paralysis. As he chronicles increasingly malevolent occurrences in a series of tweets, Adam begins to believe he is being haunted by the ghost of a dead child named David.', '/kT5tsoIWnXlLBaeOfkoso11dUgB.jpg', '/51JPcqDD2IptQueoskmY4cYpWYM.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:43', '2023-10-04 20:55:43'),
(195, 420637, 'Malibu Horror Story', 'Terror strikes when a team of paranormal investigators search a sacred cave for clues in the unsolved disappearance of four local teens.', '/dZObuzdd9jX4wEeTEhaU2rpUDLq.jpg', '/3eM5Qfvi56y9mVRLUm7x6B90TdE.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:44', '2023-10-04 20:55:44'),
(196, 790459, 'Fingernails', 'Anna increasingly suspects that her relationship with her longtime partner may not actually be the real thing. In an attempt to improve things, she secretly embarks on a new assignment working at a mysterious institute designed to incite and test the presence of romantic love in increasingly desperate couples.', '/q04g3un61aeBoheQEso7enM28AF.jpg', '/wsMuEaqX5Sks209lnjWEChCdv3C.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:55:45', '2023-10-04 20:55:45'),
(197, 946215, 'In the Fire', 'A couple with a young autistic son have to face both the villagers and the local priest who worry the boy is possessed by demonic forces and is the reason for all the village’s woes.  After the death of his wife, Don Marquez brings in Grace Victoria Burnham, an American psychiatrist to find out what is ailing the boy.', '/viY97FrC04yPvuFDvLzysz1CEnf.jpg', '/pR3pfwedCb3WiQl4htoZsecAS3d.jpg', 'upcoming', '2023-10-13', 5.50, 2, '2023-10-04 20:55:46', '2023-10-04 20:55:46'),
(198, 1153020, 'Herd', 'When a woman trying to outrun her past ends up trapped between a zombie outbreak and warring militia groups, she is caught in a world where some fight for survival but others fight for control.', '/6vvTeeXeD7rjS8DaZRGIaQR2NNK.jpg', '/5MiRiEPUi8E2y21L4nusfn8Kwu1.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:47', '2023-10-04 20:55:47'),
(199, 977262, 'Ezra', 'An erstwhile late-night comedy writer Max Brandel who blows up his successful career — and marriage — to become a somewhat less successful stand-up comic. Moving in with his father Stan, a gifted but eccentric chef turned doorman, and at loggerheads with his ex-wife and her new partner over how to best provide accommodations for their 9-year-old autistic son, Ezra, and give him the happy life he deserves. Brandel decides the solution is to kidnap Ezra and take him on a trek across the country. The result is honest, hilarious, and heart-warming.', '/4l4s2FpSTG2LSA5n6ongIuOf7di.jpg', '/roQ0cmuyDLdcV3RysigR9Akw7Ro.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:48', '2023-10-04 20:55:48'),
(200, 1117644, 'The Mission', 'American Christian missionary John Chau was murdered when he tried to illegally contact and convert some of the world’s last uncontacted indigenous people. Through exclusive interviews and archival footage of John’s journey, THE MISSION explores themes that strike deep at the heart of religion, colonialism, and anthropology, questioning where we draw the line between faith and fanaticism, exploration and exploitation, imagination and destruction.', '/nk9PEYCx79YDahOZhjm4swxtnd1.jpg', '/5yiKyF8wlGbieI6cznr50meoyJG.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:49', '2023-10-04 20:55:49'),
(201, 1155770, 'The Pigeon Tunnel', 'Academy Award® winner Errol Morris pulls back the curtain on the storied life and career of David Cornwell, the former spy known to the literary world as John le Carré.', '/xsDb7JlPS6QnI26bTP3sREz9n0K.jpg', '/9oEvKjtGQTtnLEcBfLY716T9Rv6.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:50', '2023-10-04 20:55:50'),
(202, 895549, 'NYAD', 'The remarkable true story of athlete Diana Nyad who, at the age of 60 and with the help of her best friend and coach, commits to achieving her life-long dream: a 110-mile open ocean swim from Cuba to Florida.', '/hN5bx6aP07TbDuW0cH2Du68YILb.jpg', '/8OFnVab1SxQCPZFyrt1gL929LAP.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:55:51', '2023-10-04 20:55:51'),
(203, 1156596, 'Silver Dollar Road', 'A Black family in North Carolina battles decades of harassment by land developers trying to seize their waterfront property, in this searing documentary by Oscar-nominated director Raoul Peck (I Am Not Your Negro).', '/jdjrW3kfvBM0ZrbhasydmKvpoaY.jpg', '/8vEbESa1KbOje5GljRjtdpFeBGR.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:51', '2023-10-04 20:55:51'),
(204, 1058619, 'Divinity', 'Two mysterious brothers abduct a mogul during his quest for immortality. Meanwhile, a seductive woman helps them launch a journey of self-discovery.', '/nDGij5loooxlI66SLVvT4101xEf.jpg', '/iu5RMfBVlU4v0drskl7sx3Gai0s.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:52', '2023-10-04 20:55:52'),
(205, 980285, 'Dangerous Waters', 'A sailing holiday spirals out of control when a teenage daughter uncovers the dark past of her mother\'s new boyfriend.', '/9I93qBek3Fe4VkD9aIoxPuAtH2b.jpg', '/tPw8Yty0GkCOdYPpq0pui8uKM6H.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:53', '2023-10-04 20:55:53'),
(206, 938669, 'The Bell Keeper', 'A group of friends travel to a secluded campsite to film a documentary. What they find is something much more sinister than they could have ever imagined.', '/i5jlZMBtyI70xUjBjRf63I9xadk.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:54', '2023-10-04 20:55:54'),
(207, 1015954, 'The Replaceables', 'Veteran pro wrestlers, on their final tour, face aliens who invaded a sleepy Florida town. They unite with locals in a battle for the ages: The Pro Wrestlers vs Outer Space Aliens! Can they save the day?', '/a2nfwFpbBnQwKlLuiSES0VjqAEl.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:55:55', '2023-10-04 20:55:55'),
(208, 1070032, 'Beyond Utopia', 'Hidden camera footage augments this perilous high-stakes journey as we embed with families attempting to escape oppression, ultimately revealing a world most of us have never seen.', '/fcyCtyXabv0X8TInqoL9yq5DCdb.jpg', '/2pBDP2Ip5mQemw3PYTjDLYv9XI9.jpg', 'upcoming', '2023-10-23', 0.00, 0, '2023-10-04 20:55:56', '2023-10-04 20:55:56'),
(209, 1176446, 'Symphonic Sketches', '“Symphonic Sketches” tells the story of one classical music concert performed by the Denver Philharmonic Orchestra.  Musicians from diverse racial backgrounds connect to the repertoire in unique ways and stage an unforgettable performance.', '/jt3vNvdPdBRQw3cPBpKJ7XmYTMu.jpg', NULL, 'upcoming', '2023-09-28', 0.00, 0, '2023-10-04 20:55:57', '2023-10-04 20:55:57'),
(210, 929230, 'Onyx the Fortuitous and the Talisman of Souls', 'Onyx joins a group of fellow occultists to attend a dark ritual at the mansion of their idol, Bartok. Suspecting Bartok’s nefarious intentions, Onyx is suddenly immersed in a world of monsters, mystery, and mayhem.', '/devICaLkwCklaehPpajjSd47QLP.jpg', '/t9qK31W6i2iEuwTaStctjzcEr27.jpg', 'upcoming', '2023-10-19', 0.00, 0, '2023-10-04 20:55:58', '2023-10-04 20:55:58'),
(211, 975902, 'Boudica', 'Inspired by events in A.D. 60, Boudica follows the eponymous Celtic warrior who rules the Iceni people alongside her husband Prasutagus. When he dies at the hands of Roman soldiers, Boudica’s kingdom is left without a male heir and the Romans seize her land and property.  Driven to the edge of madness and determined to avenge her husband’s death, Boudica rallies the various tribes from the region and wages an epic war against the mighty Roman empire.', '/ssEFC5wfFjj7lJpUgwJDOK1Xu1J.jpg', '/ntZl6ZiIOedafAq1tbyMzhjoUos.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:55:59', '2023-10-04 20:55:59'),
(212, 1175182, 'Big Brood', 'Adam\'s plan to propose to Allie hits a snag when he must win over her skeptical dad and survive a wild family gathering.\r Little does this family know that a much bigger problem crashed down in the woods the night they arrived: a big, body-snatching, hive queen alien, and it’s looking for its perfect match. Soon enough, the alien will take the family members one by one. Adam will have to team up with Government Agent Owens to take down the alien, rescue his girlfriend, and save the rest of the world.', '/dtp2CBZ1WSM4xW3pnaGhWzZEJL2.jpg', '/jIyVLNDNWsvXi38iCpB1geH5tTF.jpg', 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:56:00', '2023-10-04 20:56:00'),
(213, 1162322, 'After Death', 'A gripping documentary exploring the afterlife based on real near-death experiences, conveyed by scientists, authors, and survivors.', '/qPK8KAiyCxPnITYKyrgANobvBNq.jpg', NULL, 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:01', '2023-10-04 20:56:01'),
(214, 1180799, 'Tripped Up', 'Aspiring chef Lizzy sets off with her three best friends in tow to compete in the prestigious Saucy Food Festival. What begins as a calculated career move quickly turns into a madcap misadventure full of food, fun and female bonding, where the girls learn that struggle can be the secret ingredient to success.', '/k0TjTcPfifQXjpTbE7cueD4XFas.jpg', '/et04raLZD7tDFeocpP1M6D3LPm1.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:02', '2023-10-04 20:56:02'),
(215, 1006947, 'Suitable Flesh', 'After murdering her young patient, a once-esteemed psychiatrist helplessly watches her life spiral into a nightmarish maelstrom of supernatural hysteria and gruesome deaths, all linked to a seemingly unstoppable ancient curse.', '/haCPe4ivt1DgSemm1DsaOyUVJXo.jpg', '/nr4zfMGKECTrMWxcfVG2yD3kPfu.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:03', '2023-10-04 20:56:03'),
(216, 1184301, 'Hellcat', 'Aging rock star, Ricky \"Hellcat\" Heller, returns home to Indiana years after disappearing, following the tragic death of his son. Shunned by his estranged wife and much of the town, Ricky believes that he is better off dead until a kid, haunted by his own demons, shows him otherwise.', '/g3AWZbsNRC35Gn7jBM4vtlpAcO5.jpg', '/nBV4WtARY7CbrspzYwqv7nGLM8V.jpg', 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:03', '2023-10-04 20:56:03'),
(217, 1058620, 'The Persian Version', 'When a large Iranian-American family gathers in NYC for the patriarch’s heart transplant, a family secret is uncovered and catapults the estranged mother and daughter into an exploration of the past', '/5YwOnR2tJO1X0wpmSaQb4PvfT1I.jpg', '/n1ER2rJDswdM1mChgWnu0bHRPF9.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:04', '2023-10-04 20:56:04'),
(218, 1031143, 'Another Body', 'A college student searches for justice after she discovers deepfake pornography of herself circulating online.', '/pU8C939AI6CQIintohv4ghQ132x.jpg', '/jycEYzpASmk6dUZGGt0lPSnyKSU.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:05', '2023-10-04 20:56:05'),
(219, 853810, 'Winnie the Pooh - Master of Puppets', 'An evil bear goes on a killing spree.', '/78cDX2GoYClhUgBusffyCQRHknh.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:56:07', '2023-10-04 20:56:07'),
(220, 796941, 'Axe2Grind', 'Debbie Wilkins escapes from Hollywood and heads east to Oklahoma City to link up with her older sister Fran after she is released from an insane asylum for her murder spree on the set of \"The Bayou Butcher\" in Axe to Grind. Soon after their reunion, the two sisters embark on a wild and bloody cross country road trip to evade law enforcement after Debbie does away with her parole officer. Meanwhile, Rikki, the younger sister of Nikki who Debbie dispatched of in the first movie, elicits information from Debbie\'s old flame Peter Burgess in order to track down Debbie and exact her revenge.', '/mWF3BJvQ19eJNzw0T8dyEgPXF5X.jpg', NULL, 'upcoming', '2023-10-31', 0.00, 0, '2023-10-04 20:56:07', '2023-10-04 20:56:07'),
(221, 1183430, 'I Am Somebody', 'An extraordinary film about six children who are chosen to represent their country at the Street Child World Cup in Qatar. Coming from Brazil Bangladesh, Pakistan and Palestine, from refugee camps to living on the street, the chance to take part in this tournament unites them. The United Nations has estimated that there are around 100 million street-connected children worldwide, and the tournament is a chance to raise awareness and provide support. The World Cup is a chance for these young people to meet other children who share similar life experiences, empower each other with confidence, and provide them with a chance to play sports, get involved in creative activities, and find a shared joy in being together.', '/mKmhlQNYqICCd4yIdQ7BdKCtbpa.jpg', NULL, 'upcoming', '2023-10-22', 0.00, 0, '2023-10-04 20:56:08', '2023-10-04 20:56:08'),
(222, 1184050, 'Friends & Neighbors', 'In this deeply personal documentary, Benjamin Wagner sets out to understand his own mental health challenges by exploring the impact of acute and chronic stress on a population in which anxiety, depression, and dysregulation are epidemic. With the help of friends and neighbors like State Senator Sarah McBride, Somatic Psychologist Matthew D. Tousignant, and Music Therapist Kelli Rae Powell, Wagner discovers a path to resilience for himself and his neighbors.', NULL, NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:09', '2023-10-04 20:56:09');
INSERT INTO `movies` (`id`, `e_id`, `title`, `description`, `poster`, `banner`, `type`, `release_date`, `vote`, `vote_count`, `created_at`, `updated_at`) VALUES
(223, 1184341, 'Jailhouse to Milhouse', 'This is the courageous journey of Pamela Hayden, voice of the plucky, resilient Milhouse on \"The Simpsons”: After surviving an abusive boarding school and juvenile jail, as well as other setbacks, Pamela now speaks to teen girls about overcoming obstacles and turning their dreams into reality.', '/iLMh4ZRNNrae1fCFxTIC0WucAFW.jpg', '/9BaVG5X1arnbis2zhXawaaieMZm.jpg', 'upcoming', '2023-10-14', 0.00, 0, '2023-10-04 20:56:10', '2023-10-04 20:56:10'),
(224, 1181824, 'Suzie (& Jenny)', 'As the planet reaches an alarming state in terms of global warming, a 60 year-old woman decides to take action.', '/o2zrSxWluSGxxmTWQJNCdUtdoZM.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:11', '2023-10-04 20:56:11'),
(225, 1025916, 'Waiting for the Light to Change', 'Over the course of a week-long beachside getaway, Amy, having recently undergone dramatic weight loss, finds herself wrestling between loyalty to her best friend Kim and her attraction to Kim\'s new boyfriend.', '/vFbY9TPscgj7hALsYSqNXoFMK4N.jpg', '/5NDExRaBYnRH262EZYLqmZNKHiy.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:11', '2023-10-04 20:56:11'),
(226, 1181817, 'Las Nogas', 'In the year 2523 Water water nowhere, N’er a drop to drink.  500 years into the future, the earth is a dry wasteland destroyed by humans. Doctor Alma, a fluffy, brilliant Vulkeet (a cross between a parakeet and vulture) who drives a Vespa, must cure the only creatures left who can save the world by bringing back the rain - the bizarre and loveable Homeys who have fallen ill with a mysterious sickness.', '/fJJbwdPpivvVBHJyWzYok25GQaA.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:12', '2023-10-04 20:56:12'),
(227, 714889, 'The Delinquents', 'Two bank employees, Román and Morán, question their routines and their daily lives. One of them finds a solution: commit a crime. Somehow, he succeeds and extends his fate to his partner. This leads them to make a big change in their lives in the hope of a better existence.', '/7LHY6FyvqEuQPCyV7qX7opVvrpu.jpg', '/xwMI3XD4EvQtLcBCGUoGx0TBWwd.jpg', 'upcoming', '2023-10-18', 0.00, 0, '2023-10-04 20:56:13', '2023-10-04 20:56:13'),
(228, 782149, 'Holy Frit', 'In this three-year race against time, Tim Carey, a talented, yet unknown L.A. artist, bluffs his way into winning the commission to create the largest stained-glass window of its kind. The problem is, he doesn\'t know how to make it. After a desperate search, he finds someone who might have the answer: a famous glass maestro named Narcissus Quagliata.', '/hpYyyVSS5MfjhoG8009oJehjd8L.jpg', '/3iDEWJ6BXfeLbvoW3pVdKgJfN0L.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:14', '2023-10-04 20:56:14'),
(229, 1181415, 'The Island In Me', 'The film follows two women who grew up in the remote atoll of Pukapuka in the Cook Islands and return home after decades away to find the atoll, and themselves, forever changed. Amelia Hokulea Borofsky, the daughter of anthropologist Robert Borofsky who lived in Pukapuka in the mid 1970’s and Johnny Frisbie, a Cook Island legend in her own right. Her book Miss Ulysses of Puka-Puka written at age fifteen, was the first published literary work by a Pacific Islander author. Both lived on Pukapuka as children and left at different times, but they both return to reconnect – with emotion, celebration, and a sense of belonging. Filmmaker Gemma Cubero del Barrio also weaves in her own intimate story.', '/8dXytEvrKbyW4h3w1dOXFy8EDCz.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:15', '2023-10-04 20:56:15'),
(230, 1181414, 'Finding the Money', 'Can a new economic theory revolutionize our ability to tackle the climate crisis?  An underdog group of economists is on a mission to instigate a paradigm shift, by flipping our understanding of the national debt — and the nature of money — upside down.  With a ‘debt ceiling’ debate and threat of default taking over headlines for the past six months in the US, many people find themselves asking - what is the national debt anyways? And why would the issuer of the US dollar ever need to borrow US dollars in the first place? With the enormous challenges of climate change and humanely caring for people on the horizon, the biggest obstacle presented is usually the question: ‘But how will we pay for it?” and “Where will we find the money?” According to Stephanie Kelton, face of the new economic theory known as “Modern Monetary Theory” or MMT, those aren’t the right questions to be asking a currency issuing nation.', '/r9op5ATahfT5DHo8n9AC5F8orYS.jpg', NULL, 'upcoming', '2023-10-19', 0.00, 0, '2023-10-04 20:56:16', '2023-10-04 20:56:16'),
(231, 1057006, 'Sight', 'Dr. Ming Wang is not simply an eye surgeon: he is a beacon of empathy for humankind. Based on his incredible true story, Sight offers glimpses of hope at times when it feels the hardest to find.', '/15CF0WoeBe1MZ7JhxjTU1Xixo4P.jpg', '/yK1kZzoR5rL4eJNp2sT1fOxzJ9X.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:17', '2023-10-04 20:56:17'),
(232, 1181967, 'What Is Love?', 'Documentarian Steve Bollman joins together scientific discovery, real-life stories and faith to investigate love.', '/lhKIArhDJ82unUgt83VCzqtjkGZ.jpg', NULL, 'upcoming', '2023-10-16', 0.00, 0, '2023-10-04 20:56:17', '2023-10-04 20:56:17'),
(233, 1181811, 'Conceiving Our Future', 'CONCEIVING OUR FUTURE is a short documentary that explores the tension around young people deciding not to have children due to climate change. Isabella, a 32-year-old farmer, and Jem, a 36-year-old carpenter, always envisioned themselves raising kids. Their feelings have changed, however, as climate change has worsened. After a particularly catastrophic summer in their home state of Oregon, the couple decides against ever becoming parents. While they present a resolved front, their parents are distraught by the news. The family gathers around a fire-pit one January night in Ashland to air out their feelings about Jem and Isabella’s childless future, revealing a generational divide about the meaning of hope in a world on fire.', '/2ZrvNkpLZ957aaBBNcIio9zbCbH.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:18', '2023-10-04 20:56:18'),
(234, 1180879, 'Soul Mates', 'Follows Allison and Jason, two unsuspecting strangers who must find their way out of a nightmarish maze where they were forced to get into as part of a twisted new dating service created to help them find their Soul Mate.', '/93qyqak9QpN2Xpq8IbusAJKUXXN.jpg', '/2eCWKkeQc8ASKN8pSyrhFOEUfx0.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:19', '2023-10-04 20:56:19'),
(235, 1149881, 'SlashFM II', '', '/hLUj10LSxiQuJUDv2GVF4iZWGtu.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:56:20', '2023-10-04 20:56:20'),
(236, 1181421, 'X Trillion', '14 WOMEN, 3000 MILES, X TRILLION PIECES OF PLASTIC  A journey that promises to change not only the women\'s lives but the very future of our planet. X Trillion follows the journey of 14 women as they sail a gruelling 3000 miles across the North Pacific Ocean to one of the most remote places on Earth, but also the location of the densest accumulation of ocean plastic - the Great Pacific Garbage Patch.​ A life-afﬁrming, optimistic story of adventure, discovery, science and solidarity.', '/2PX5ymJPqdNL4AzawWv1d5bPflp.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:21', '2023-10-04 20:56:21'),
(237, 1181402, 'ACID Canal', 'When a rural irrigation district in Northern California has its water cutoff during a historic drought, the community must join together to face the devastating impacts to their way of life and the environment around them.', '/pD8e2TRNKW0yPqbQjtDdLWIsh6m.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:22', '2023-10-04 20:56:22'),
(238, 1181406, 'Dirt', 'Break through the surface to explore the living, breathing ecosystem beneath our feet. “Dirt” — a new documentary about saving our soil — delves into how Arkansas farmers, ranchers and more are improving their operations by helping the environment.', '/wCrLcdAMXz33REjl23mvLa9hqQO.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:22', '2023-10-04 20:56:22'),
(239, 1181823, 'Sending', 'SENDING is a musically immersive cinematic narrative about a lifetime of rock climbing experience shared by a group of friends coming together for a weekend of bouldering in The Buttermilks. Through a heart-felt introspective visual poem written by Carlos Mason, the film explores the personal pursuit of fulfillment through rock climbing in the wilderness. Waking at first light after late night drives through darkness, we share beautifully sunlit mountain wanderings of psychedelic-like natural highs that are eventually grounded by climbing\'s sharply humbling crux of patience and perseverance. It\'s an inspiring cycle towards the majestic summit of reward - Sending the Project - with the embrace of friends supporting from below, and celebrating around the fire, beneath the stars in the Eastern Sierra moonlit glow.', '/nPYMSQbIgnGX9x8BVkTjKTpzjdU.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:24', '2023-10-04 20:56:24'),
(240, 1172291, 'Full Circle', 'Faced with a traumatic injury that renders you permanently disabled; how would you reinvent yourself? In 2014, Trevor Kennison’s life was forever altered by a broken back - for worse and for better, in equal measures. Barry Corbet, an intrepid skier, mountaineer, explorer, filmmaker, and Jackson Hole legend, broke his back in a helicopter crash in 1968. Frustrated by a pre-ADA culture that did not accept or support the disabled, Barry reinvented himself, becoming a seminal leader in the disability community. Full Circle follows Trevor on a path towards post-traumatic growth in parallel with Barry, 50 years later. Their stories mirror each other, connected through time and space by common locations and motifs; injuries in the Colorado backcountry, rehab at Craig Hospital, fame in Jackson Hole; but also, through their shared resiliency and refusal to let their passion for life be limited by their injuries.', '/t8sS3FYuzrL60Vvh03JjyWlnGpo.jpg', '/aZuPWQM7hq3FIcbuQV5jFKqekWF.jpg', 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:24', '2023-10-04 20:56:24'),
(241, 1175101, 'Audio and Visual Experiment 8', 'The eighth in an ongoing collaboration between video editor Grandt Savages and audio editor Hugo Alexander, made entirely using remixed media.', '/aDNYNDNqVIzjXJkqTFjIfpNHbgo.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:56:25', '2023-10-04 20:56:25'),
(242, 1181423, 'Down River Jordan', 'The Jordan River has played a major role in shaping human society as we know it, providing freshwater and fertile soil for some of the earliest civilizations and witnessing the rise and fall of empires. For centuries, the lower Jordan Valley has served as one of the largest bird migration sites in the world, as well as the biologically diverse sanctuary where the flora and fauna of the East African and West Asian continents come together.  Today, the river tells a different story from the life-giving tale it has told for a millennium revealing the devastating impact of human political conflict as Syria, Jordan, and Israel take from the Jordan River without international regulation or waste-management infrastructure. The tension between the riparian nations and the lack of a trilateral water management agreement has allowed for excessive extraction, harmful waste practices, and a tendency to assign blame to others rather than take responsibility for the river’s well-being.', '/9JKH7PIJCDKoUQC2Kh0cDOBSJn6.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:26', '2023-10-04 20:56:26'),
(243, 588648, 'Dragonkeeper', 'In ancient China, dragons were once friends of men, but men’s greed and lust for power ended their alliance, and these wise and magical creatures were hunted down by the Empire. Years later, in a remote fortress, a young slave girl named Ping strikes up an unlikely friendship with Long Danzi, the last of the imperial dragons. Learning the power of Qi, Ping helps the dragon escape from captivity and together they journey across the Empire in order to save his lineage, chased by the Emperor’s men and pursued by even darker powers.', '/nxETRt3GuFUwInDqHMIbpqYSkGJ.jpg', '/yEOfeRQXt1V7YEukObddsZOvCVf.jpg', 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:27', '2023-10-04 20:56:27'),
(244, 1181810, 'Brearth', 'An evolutionary journey through a contaminated human dystopia packed in plastic waste that suffocates you.  The future is the present. The earth is dying. The human being decomposes and recycles, perishable material until now...  An experimental animated film created with AI-generated visuals that will take your breath away.', '/5mChLhiynDvtw27TfHiNb0i4140.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:28', '2023-10-04 20:56:28'),
(245, 1166343, 'Three Idiots and a Rock', 'Three dim-witted time travel agents are sent on a mysterious mission in modern-day Los Angeles.', '/kDFHv4JaLw9KgHptWN1MXVYlzf2.jpg', '/qpbmA9mCzd7STsXVOPcuEWvYwMZ.jpg', 'upcoming', '2023-10-16', 0.00, 0, '2023-10-04 20:56:29', '2023-10-04 20:56:29'),
(246, 1181822, 'Seeds of Change', 'An organic Farmer in Maine sets out to transform the prison food system. Seeds of Change captures the intersecting stories of life-long farmer Mark McBrine and several incarcerated men as they harvest their own meals from a five-acre prison garden unlike any other.', '/ohCNHXwjOayu8RGtRYqUoRSUDIh.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:30', '2023-10-04 20:56:30'),
(247, 1181808, 'Anxious', 'Noah is so worried about climate change he can\'t sleep at night. His wife Hali is confident it\'s all going to be just fine. Should they even have kids?! Should they sell their CA house and move to a colder Alaska? How does one plan for the end of the world...?', '/l6XPXd7XGdbvkxQUIGL88lEEhVs.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:30', '2023-10-04 20:56:30'),
(248, 1127690, 'The Real Haunted Mansion 2', 'The Real Haunted Mansion 2 explores the rich history and investigates the ghostly activity for the first time at an historic Gothic Iowa Mansion with a team of Historians and Paranormal Investigators.', '/ctZQGBA65o7vJw0D6cQXWDTcQaO.jpg', '/8F0xa31eIY6MeNoHx9QlZDBeT46.jpg', 'upcoming', '2023-10-31', 0.00, 0, '2023-10-04 20:56:31', '2023-10-04 20:56:31'),
(249, 1181815, 'Growing Up Green', 'Growing Up Green\' takes a fresh look at The Findhorn Community in the North East of Scotland through the eyes of three young people who grew up there. We discover both the positive and negative impact the Foundation has had on their personal beliefs and values, and how growing up in this community has influenced their views on the current climate emergency and their lives in general.', NULL, NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:32', '2023-10-04 20:56:32'),
(250, 1097753, 'I HEART HORSE', 'A lonely doodler forges an intense emotional bond with a horse.', '/zvMYEt3xJnIcWMOtCQWwEWJqiF.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:33', '2023-10-04 20:56:33'),
(251, 1181412, 'Dormouse Detectives', 'Garden dormice are supposed to be at home all over Europe. But recently they have started to go missing. A disappearance so mysterious, that researchers and conservationists have hurried to form a special task force of unprecedented size and scope. Their investigation focuses on possible causes for the massive decline in the cute rodent’s numbers. Time is of the essence. Only if the Dormouse Detectives manage to solve this puzzling case, they may still be able to save the species.', NULL, NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:34', '2023-10-04 20:56:34'),
(252, 1181419, 'A Rhino\'s Life', 'The shock of very first raindrops on a baby rhino\'s skin; horns, that may either be tender or inflict serious pain. Droughts, predators, mating acrobatics - a rhino\'s life is as full of surprises as it is rich with deep social bonds from the start. So is the close relationship between Malaika and her son Elias. For years, the two of them are inseparable. But Malaika is pregnant. When she finally goes into labor, nothing is the same anymore.', NULL, NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:34', '2023-10-04 20:56:34'),
(253, 508388, 'Rodentia', 'A group of young men stroll through their bummer summer.  Meanwhile, a military experiment gets poured into their local river.', '/kH0opBmRLCdqMfyIjzYd4AxsVpv.jpg', '/z4mnzhJsgOPGErnF3gXCKOkGVll.jpg', 'upcoming', '2023-10-30', 0.00, 0, '2023-10-04 20:56:35', '2023-10-04 20:56:35'),
(254, 1028583, 'Isleen Pines', 'ISLEEN PINES follows a group of friends celebrating their traditional Halloween festivities in their hometown. From a strange neighbor, the biggest costume party of the year, and mysterious sinister creatures...something is different this year.', '/xqPvk3pnhakTl0wNGE0ioO0kraw.jpg', NULL, 'upcoming', '2023-10-28', 0.00, 0, '2023-10-04 20:56:36', '2023-10-04 20:56:36'),
(255, 1182548, 'Somewhere all the boys are birds', 'Benjie\'s obsession with long-dead Filipino movie star Jaime Reyes leads him to the rooftop where the actor killed himself. Here, he summons Jaime\'s ghost for a conversation.', '/exhbFmvbDXApRgoKuDapTTquZLK.jpg', NULL, 'upcoming', '2023-10-15', 0.00, 0, '2023-10-04 20:56:37', '2023-10-04 20:56:37'),
(256, 1177377, 'BONDED', 'Doctor Reeve and his group of friends discover their annual trip is being stalked by a patient from the past.', '/x4pgnky2AfjCeBl9gPpLN7ZLxcK.jpg', NULL, 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:38', '2023-10-04 20:56:38'),
(257, 1118195, 'Miracle in East Texas', 'Two con men try to convince a group of widows to invest in worthless oil wells during the Great Depression.', '/vgBGPUm4clPU5DC3SuC1Q5ZPPpC.jpg', NULL, 'upcoming', '2020-02-07', 0.00, 0, '2023-10-04 20:56:38', '2023-10-04 20:56:38'),
(258, 935355, 'Parallel Heroes', 'After inventing a parallel universe connector at only 16, the three friends are pulled in to find themselves in a world with supernatural versions of themselves', NULL, NULL, 'upcoming', '2023-10-21', 0.00, 0, '2023-10-04 20:56:39', '2023-10-04 20:56:39'),
(259, 1185927, 'I Heard You Edit Baby Videos', 'Freelance Video editor and loser Marcel Coogan, desperatly wants to get his movie made. So, when hired by a mysterious client for a midnight meeting across town, Marcel will encounter Gasoline addicts, homicidal way station clerks, and a stalking 7ft baby that records his every move.', '/aIsd5mVusrlMRo62ug9C6JomY1s.jpg', '/tuJQWPaMkgfonTWjyAno9Th0tGc.jpg', 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:41', '2023-10-04 20:56:41'),
(260, 1174431, 'Sacrament', 'In the 1950s, two religious young men go on a camping trip together. As their forbidden love for each other begins to boil into reality, Belford battles with his inner truth and inner demons.', '/mbxqAZFK0DypnyRMwSdYWKPpc7b.jpg', NULL, 'upcoming', '2023-10-15', 0.00, 0, '2023-10-04 20:56:42', '2023-10-04 20:56:42'),
(261, 1171995, 'Survey', 'Sam works for a local cable company. His life gets turned upside down when a customer by the name of Daniel Mook requests Sam to go the extra mile to receive a good survey. Sam, who’s struggling with his metrics at work, decides to help Mook with his request. He quickly learns that Daniel Mook isn’t who he claims to be.', '/iHZq4q45fLkm0cvDyzlyk2M7wnY.jpg', NULL, 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:43', '2023-10-04 20:56:43'),
(262, 1185024, 'Flowers Grow Out of my Grave', 'He\'s trying to save him, his soul sure but him nonetheless!', NULL, NULL, 'upcoming', '2023-10-22', 0.00, 0, '2023-10-04 20:56:43', '2023-10-04 20:56:43'),
(263, 1106108, 'Bhagwan Bharose', 'A story about two young, impressionable kids whose ideas about faith are constantly questioned and changed as their little world expands and takes into its fold, their country\'s fast-changing socio-political landscape.', '/7w17lS75oxMdjWE5mYIgCyisKrm.jpg', NULL, 'upcoming', '2023-10-13', 8.50, 2, '2023-10-04 20:56:44', '2023-10-04 20:56:44'),
(264, 1184133, 'Ruiz', 'At the core of these memories is Kcey, a spirited young woman of Puerto Rican and African American heritage. Her infectious spirit and uniquely endearing laugh became her signature, filling every room with infectious energy and joy. As a child, Kcey\'s spirited antics foreshadowed her future strength; she later emerged as a formidable member of the Air Force. Recollections from her mother, father, sister, childhood friend, and a battle buddy capture the essence of Kcey, from her infectious laughter to her cherished moments under the Afghan sunsets. Each memory serves as a testament to a life lived passionately. However, heartbreak strikes when, amid war, a plane crashes, claiming Kcey\'s life. As they grapple with this devastating loss, her loved ones oscillate between despair and denial, occasionally seeking refuge in work or the numbing embrace of alcohol. Yet, as they collectively mourn, they discover solace in their shared memories of Kcey\'s radiant spirit.', '/chPc7HxBQiPlVcVl43OrS4uPT40.jpg', NULL, 'upcoming', '2023-11-01', 0.00, 0, '2023-10-04 20:56:45', '2023-10-04 20:56:45'),
(265, 1176512, 'Audio and Visual Experiment 9', 'The ninth in an ongoing series of collaborations between video editor Grandt from Savages and audio editors, this time featuring Lauz Goattem. Made entirely using remixed media.', '/pxmjIUptQKgfuh7cDixRwqmmjfN.jpg', NULL, 'upcoming', '2023-10-20', 0.00, 0, '2023-10-04 20:56:46', '2023-10-04 20:56:46'),
(266, 1100134, 'Leech', 'An elderly blind woman is unaware of the stranger secretly living in her home.', '/6gq0ty1XhZKnCwVgvy5FuCKCVew.jpg', NULL, 'upcoming', '2023-10-12', 0.00, 0, '2023-10-04 20:56:47', '2023-10-04 20:56:47'),
(267, 1184811, 'Do Ask, Do Tell: The Linda Campbell Story', 'Set against the backdrop of the repeal of the \"Don\'t Ask, Don\'t Tell\" policy, the film chronicles the journey of Lt. Col. Linda Campbell, an Air Force veteran who grappled with hiding her true self during her service tenure. While the national policy shift towards LGBTQ+ rights marks a progressive era, Linda\'s personal story serves as a powerful testament to the individual battles fought in the shadows of such policies. Subjected to suspicion, prejudice, and threats from her comrades due to her perceived homosexuality, Linda\'s resilience remain undeterred. Her unwavering love and commitment to her partner, Nancy Lynchild, culminate in a poignant milestone: their eternal rest together in Willamette National Cemetery. Intertwined with this narrative is the account of Linda\'s brother, Bob Campbell, who delves into their family\'s conservative roots, Linda\'s tumultuous coming out, and the eventual familial reconciliation that showcases the transformative power of love and understanding.', '/uUabEiyEoi3utxjpG9a6KH7snGx.jpg', NULL, 'upcoming', '2023-11-01', 0.00, 0, '2023-10-04 20:56:48', '2023-10-04 20:56:48'),
(268, 1077937, 'THE BUNNY MAN', 'The feature film debut from Virginia based filmmaker Haseb Alim.', '/aVvNEm53HorGs3CqHaxAcM00oaE.jpg', NULL, 'upcoming', '2023-10-31', 0.00, 0, '2023-10-04 20:56:48', '2023-10-04 20:56:48'),
(269, 1147231, 'This Dinner Will End', 'Unassuming Calvin comes into contact with a paranormal spirit, Cecilia, before his impromptu dinner party.', NULL, NULL, 'upcoming', '2023-10-27', 0.00, 0, '2023-10-04 20:56:49', '2023-10-04 20:56:49'),
(270, 1158013, 'Conte: Transitioning Politics', 'An extraordinary tale of resilience unfolds against the backdrop of intense political rivalry and media scrutiny. Joanne Conte, the indomitable child of Italian immigrants, weathers the storm of public vilification as her past is unceremoniously plastered across the front pages of Colorado papers and on The Maury Povich Show. Yet, this assault on her character is not enough to halt the unwavering march of her life of service. She breaks barriers as the first transgender person to be elected to a city council in U.S. history, but her identity extends far beyond this groundbreaking accomplishment. As a valiant soldier, an impassioned activist, and a tenacious politician, Conte carves out a formidable legacy. This is an emotionally charged and evocatively detailed portrait of Joanne Conte, a multifaceted individual who lived her life far beyond the simplistic narratives of headlines.', '/pFJV6c1UB3SxqnDTwBXTH4fvt0O.jpg', NULL, 'upcoming', '2023-11-01', 0.00, 0, '2023-10-04 20:56:50', '2023-10-04 20:56:50'),
(271, 1184352, 'Decoding Jean: Secrets of WWII', 'In the midst of World War II\'s turmoil, the quaint British town of Bury St. Edmonds becomes a focal point where lives intersect and secrets unravel. An 18-year-old woman, finds herself caught in the throes of a great wartime secret – the breaking of the German Enigma code. Her recruitment into the \"Ultra\" program brings her to the heart of Bletchley Park\'s most clandestine operations, where Alan Turing and his team forge the world\'s first computer in a bid to crack the ever-changing German codes. Every day, she grapples with the weight of the secret, so profound that even her family is oblivious to her covert role. Meanwhile, she captures the heart of an assertive American soldier and their whirlwind wartime romance culminates in a heartwarming union, facing the challenges of the Official Secrets Act. The soldier, persistent and deeply in love, goes to great lengths, in order to secure her release from the program and to solidify their commitment to one another.', '/AbUzcIkwRo090vZbWVcvza1zAWl.jpg', NULL, 'upcoming', '2023-11-01', 0.00, 0, '2023-10-04 20:56:51', '2023-10-04 20:56:51'),
(272, 1163817, 'The Chaplain: MAJ Brenda Threatt', 'In a profound exploration of faith, service, and identity, this documentary film follows Brenda Elizabeth Threat, an ordained minister in the African Methodist Episcopal Church and a military chaplain in the California State Guard. Born in Los Angeles, Threat\'s story is a captivating tapestry of her spiritual journey, her tireless advocacy for veterans, her innovative response to 9/11, and her reflections on race and personal integrity. Her life is a testament to the power of perseverance, love, and community. Guided by a commitment to education and a mission to help others be the best they can be, her story is a soul-stirring reminder that each of us has the potential to make the world a better place, one good deed at a time.', '/wHEAC7PxVwk8hVW3cplV8M17Rhp.jpg', NULL, 'upcoming', '2023-11-01', 0.00, 0, '2023-10-04 20:56:52', '2023-10-04 20:56:52'),
(273, 1187019, 'EQUINOX', 'EQUINOX is a short film about a boy who once dreamed of going to space who gets diagnosed with a terminal disease and only has a short period of time left to live. His sister is determined to not let that happen. EQUINOX covers themes of loss, grief, and the unique bond that siblings have.', '/yKSuMqmS2pPGJ2reqyYKnXJmSSH.jpg', NULL, 'upcoming', '2023-10-13', 0.00, 0, '2023-10-04 20:56:53', '2023-10-04 20:56:53'),
(274, 1186850, 'The Making of a Japanese', 'Intimately following 1st and 6th graders at a public elementary school in Tokyo, we observe kids learning the traits necessary to become part of Japanese society.', NULL, NULL, 'upcoming', '2023-10-25', 0.00, 0, '2023-10-04 20:56:53', '2023-10-04 20:56:53'),
(275, 1186818, 'Opus One: Pocket Index', 'Ogilive Brickwidow lands an interview for a new job at a mining company, however, strange things begin to happen, and she learns that this company could be hiding a dark secret.', '/2blYU20G2Jc1KWBubnI3MjCPGXz.jpg', '/vhhI8gRisWpFibDKVWpAFBcfFk5.jpg', 'upcoming', '2023-10-14', 0.00, 0, '2023-10-04 20:56:54', '2023-10-04 20:56:54'),
(276, 1093795, 'zindagi chist', 'After reminiscing on a beautiful & terrifying dream, abdullah & rahim ask the question... what is life except sorrow?', '/9GuvRV424br97SYtCQGgvEjdC6q.jpg', NULL, 'upcoming', '2023-10-26', 0.00, 0, '2023-10-04 20:56:55', '2023-10-04 20:56:55'),
(277, 1152415, 'Dissociation', 'A curious genealogist delves into the history of a vanished family, soon finding herself in a dangerous, life-threatening situation.', '/x6XwKX31XnSsK0ibLtZqZq3zfNa.jpg', '/fdscjAXbPV2DO7jWNmRwT01WMRS.jpg', 'upcoming', '2023-10-14', 0.00, 0, '2023-10-04 20:56:56', '2023-10-04 20:56:56'),
